###SITEURL###','Email&nbsp;Address:'=>'ኤፖስታ&nbsp;አድራሻ፥','Sorry, you are not allowed to manage terms in this taxonomy.'=>'ይቅርታ፣ እዚህ ፈርጅ ላይ ስያሜወችን ለመሰረዝ አልተፈቀደለዎትም።','Sorry, you are not allowed to edit terms in this taxonomy.'=>'ይቅርታ፣ እዚህ ፈርጅ ላይ ስያሜወችን ለማረም አልተፈቀድለወትም።','Attempting to parse a shortcode without a valid callback: %s'=>'ከሚሰራ ጥሪ-መልስ ውጭ፥  %s አጭር ኮዶችን ለመተንተን እየሞከረ ነው','moved to the Trash.'=>'ወደ መጣያ ተወስዷል።','Invalid key.'=>'ዋጋቢስ ቁልፍ።','Invalid object ID.'=>'ዋጋቢስ ቁስ አይ.ዲ።','Close deleted text tag'=>'የተሰረዘ ጽሁፍ መለያ-ምልክት ዝጋ','Could not insert term into the database.'=>'የውሂብ ጎራው ውስጥ ስያሜ ማስገባት አልተቻለም።','<strong>Error</strong>: The password you entered for the username %s is incorrect.'=>'<strong>ስህተት</strong>፥ ለተጠቃሚ ስም %s ያስገቡት የይለፍ ቃል የተሳሳተ ነው።','Nicename may not be longer than 50 characters.'=>'ቅጽል ስም ከ50 ቁምፊወች በላይ መሆን አይችል ይሆናል።','<strong>Error</strong>: The email field is empty.'=>'<strong>ስህተት</strong>፥ የኢሜይል መስክ ባዶ ነው።','<strong>Error</strong>: The password you entered for the email address %s is incorrect.'=>'<strong>ስህተት</strong>፥ ለዚህ ተጠቃሚ ስም %s ያስገቡት የይለፍ ቃል የተሳሳተ ነው።','The site you were looking for, %s, does not exist.'=>'ይፈልጉት የነበረው ጣቢያ ፣ %s፣ የለም።','Mission complete. Message %s deleted.'=>'ተልዕኮ ተጠናቋል። መልዕክት %s ተሰር ዟል።','Appearance'=>'ቁመና','Unable to retrieve the error message from MySQL'=>'የስህተት መልዕክቱን ከMySQL ማግኘት አልተቻለም','Could not open file handle.'=>'ፋይሉ መክፈት አልተቻለም።','Creating comment failed.'=>'አስተያየት መፍጠር አልተሳካም።','Updating comment status failed.'=>'የአስተያየት ሁኔታን ማደስ አልተሳካም።','Updating comment failed.'=>'የአስተያየት ማደስ አልተሳካም።','A label describing the test.'=>'ፈተናውን የሚገልጽ መለያ።','The status of the test.'=>'የፈተናው ሁኔታ።','The provided password is an invalid application password.'=>'የቀረበው የይለፍ ቃል ልክ ያልሆነነው።','Sorry, you are not allowed to manage post statuses.'=>'ይቅርታ፣ የፖስት ሁናቶች እንዲያስተዳድሩ አልተፈቀደልዎትም።','Theme starter contentRecent Posts'=>'የቅርብ ጊዜ ፖስቶች','Attachment type.'=>'አባሪ አይነት።','Cannot view post type.'=>'የፖስቱ አይነት ማየት አይቻልም።','Video Player'=>'ቪዲዮ አጫዋች','Audio Player'=>'ድምፅ አጫዋች','Sorry, you are not allowed to order users by this parameter.'=>'ይቅርታ ፣ ተጠቃሚዎችን በዚህ ልኬት እንዲያዙ አይፈቀድልዎትም።','Sorry, you are not allowed to give users that role.'=>'ይቅርታ፣ ይህንን ተጠቃሚ ይህን ሀላፊነት መስጠት አልተፈቀደልዎትም፡፡','Empty Term.'=>'ተርምን ባዶ አድርግ ።','Invalid item ID.'=>'ልክ ያልኾነ ንጥል መታወቂያ ።','The slug &#8220;%s&#8221; is already in use by another term.'=>'ስሉግ &#8220;%s&#8221; በሌላ ጊዜ ጥቅም ላይ ውሏል ።','<strong>Error</strong>: The username field is empty.'=>'<strong> ስሕተት </strong>፦ የተጠቃሚ ስም መስክ ባዶ ነው ።','You can create a %s file through a web interface, but this doesn\'t work for all server setups. The safest way is to manually create the file.'=>'በድር በይነገጽ በኩል %s ፋይል መፍጠር ይችላሉ ፣ ነገር ግን ይህ ለሁሉም የአገልጋይ ቅንብር አይሰራም ። አስተማማኝው መንገድ ፋይሉን በእጅ መፍጠር ነው ።','Sorry, you are not allowed to edit this comment.'=>'ይቅርታ ፣ ይህን አስተያየት አርትዕ ለማድረግ አልተፈቀደም ።','Could not insert term relationship into the database.'=>'የስያሜ ግንኙነት ወደ ውሂብ ጎታው ማስገባት አልቻለም ።','Invalid shortcode name: %1$s. Do not use spaces or reserved characters: %2$s'=>'ልክ ያልኾነ አቋራጭ ስም ፥ %1$s ። ባዶ ቦታዎች ወይም የተቆረጡ ቁምፊዎች አትጠቀሙ ፥ %2$s','The tag cloud will not be displayed since there are no taxonomies that support the tag cloud widget.'=>'የመለያ ደመናውን የመለያ የደመና ማረጋጊያ የሚደግፉ የቀረጥ ኢኮኖሚዎች ስላሉ የመለያ ደመና አይታይም ።','On some systems the name of your database is prefixed with your username, so it would be like <code>username_%1$s</code>. Could that be the problem?'=>'በአንዳንድ ሥርዓቶች ላይ የውሂብ ጎታዎ ስም አስቀድሞ የተጠቃሚ ስምዎ ላይ ተጭኖበታል ፣ ስለዚህ ልክ እንደ <code>username_%1$s</code> ይሆናል ። ታዲያ ችግሩ ይህ ሊሆን ይችላል?','Are you sure the database server is not under particularly heavy load?'=>'እርግጠኛ ነዎት የውሂብ ጎታ አገልጋዩ በተለይ ከባድ ጭነት ላይ አይደለም?','It looks like nothing was found at this location. Maybe try visiting %s directly?'=>'በዚህ አካባቢ ምንም የተገኘ አይመስልም ። ምናልባት %s በቀጥታ ለመጎብኘት ይሞክሩ ይሆን?','Check your inbox at %s and click the link given.'=>'በ %s የገቢ መልዕክት ሳጥንዎን ይፈትሹ እና የተሰጠውን አገናኝ ጠቅ ያድርጉ ።','You are currently browsing the %1$s blog archives for the day %2$s.'=>'%1$s የጦማር መዛግብት ለ ቀን %2$s እያሰሱ ነው ።','You are currently browsing the %1$s blog archives for %2$s.'=>'አሁን %1$s የጦማር መዛግብት ለ %2$s እያሰሱ ነው ።','You are currently browsing the %s blog archives.'=>'አሁን %s የጦማር መዛግብት እያሰሱ ነው ።','Term meta cannot be added to terms that are shared between taxonomies.'=>'በታክሲዎኖች መካከል በተጋሩ ቃላት ላይ የቃላት ሜታ ሊታከል አይችልም ።','Unregistering a built-in taxonomy is not allowed.'=>'ያልተገነባ-ውስጥ ታክስ ምዝገባ አይፈቀድም ።','1 result found. Use up and down arrow keys to navigate.'=>'1 ውጤት ተገኝቷል ። ለማሰስ የላይ እና የታች ቀስት ቁልፎችን ይጠቀሙ ።','Sorry, you are not allowed to preview drafts.'=>'ይቅርታ ፣ ረቂቆችን ቀድሞ ማየት አልተፈቀደም ።','A name is required for this term.'=>'ለዚህ ቃል ስም ያስፈልጋል ።','Time Slider'=>'ጊዜ ቆራጭ','Volume Slider'=>'የድምፅ ተንሸራታች','Use Up/Down Arrow keys to increase or decrease volume.'=>'የድምጽ መጠን ለመጨመር ወይም ለመቀነስ የላይ/ታች ቀስት ቁልፎችን ይጠቀሙ ።','Use Left/Right Arrow keys to advance one second, Up/Down arrows to advance ten seconds.'=>'አንድ ሴኮንድ ለማራመድ የግራ / ቀኝ ቀስት ቁልፎችን ይጠቀሙ ፣ ለአስር ሰከንዶች ለማራመድ ያንኑ ላይ / ታች ቀስቶች ይጠቀሙ ።','Sorry, you are not allowed to upload media on this site.'=>'ይቅርታ ፣ በዚህ ጣቢያ ላይ ሚዲያ ለመጫን አልተፈቀደም ።','Sorry, you are not allowed to upload media to this post.'=>'ይቅርታ ፣ እዚህ ፖስት ላይ ሚዲያ እንድትጭን አልተፈቀደልህም ።','Invalid parent type.'=>'ልክ ያልኾነ የወላጅ ዓይነት ።','Alternative text to display when attachment is not displayed.'=>'አባሪ በማይታይበት ጊዜ ለማሳየት አማራጭ ጽሑፍ ።','Details about the media file, specific to its type.'=>'ስለ ሚድያ ፋይል ዝርዝር ፣ በአይነቱ የተወሰነ ዝርዝር ።','The ID for the associated post of the attachment.'=>'ለአባሪ ድህረ ገጽ ተዛማጅ መታወቂያ ።','No Content-Type supplied.'=>'ምንም ዓይነት ይዘት ያለው አይገኝም ።','No Content-Disposition supplied.'=>'ምንም ዓይነት ይዘት ያለው መግለጫ አይቀርብም ።','Content hash did not match expected.'=>'የይዘት ሃሽ ከሚጠበቀው ጋር አልተዛመደም ።','Limit result set to attachments of a particular media type.'=>'የአንድ የተለየ የሚዲያ አይነት አባሪዎች ላይ የወሰን ውጤት ተዘጋጅቷል ።','Limit result set to attachments of a particular MIME type.'=>'የአንድ የተለየ MIME አይነት አባሪዎች ላይ የውጤት ወሰን ።','Whether to bypass Trash and force deletion.'=>'ከጥራዝ እና የሃይል መሰረዝን ማለፍ ።','Creating a comment requires valid author name and email values.'=>'አስተያየት መፍጠር ትክክለኛ የደራሲ ስም እና የኢሜይል እሴቶች ይፈልጋል ።','Invalid comment author ID.'=>'ልክ ያልኾነ አስተያየት የደራሲ መታወቂያ ።','Unique identifier for the object.'=>'የነገሩ ልዩ መለያ','The ID of the user object, if author was a user.'=>'የተጠቃሚው ነገር መታወቂያ ፣ የደራሲው ተጠቃሚ ከሆነ ።','URL to the object.'=>'ወደ ነገር URL ።','The ID of the associated post object.'=>'የአገናኝ ድህረ ነገር መታወቂያ ።','Avatar URL with image size of %d pixels.'=>'የአቫታር URL ምስል መጠን ከ %d ፒክስሎች ጋር ።','Limit response to posts published after a given ISO8601 compliant date.'=>'የድምፅ ቆጠራ የድምፅ መጠን መቀነስ ISO8601 አቤቱታ ከተሰማ በኋላ የታተመባቸው ጽሑፎች ቁጥር ውስን ነው ።','Limit result set to comments assigned to specific user IDs. Requires authorization.'=>'ለተወሰኑ የተጠቃሚ መታወቂያዎች የተመደቡ አስተያየቶች ላይ የውጤት መጠን ተዋቀረ ። ፈቃድ ይጠይቃል ።','Ensure result set excludes comments assigned to specific user IDs. Requires authorization.'=>'ውጤት በተወሰኑ የተጠቃሚ መታወቂያዎች የተመደቡ አስተያየቶችን ማካተቱን ያረጋግጡ ። ፈቃድ ይጠይቃል ።','Limit result set to that from a specific author email. Requires authorization.'=>'ከተወሰነ የደራሲ ኢሜይል ላይ ለዚያ የተወሰነ መጠን ያለው ውጤት ይወሰን ። ፈቃድ ይጠይቃል ።','Limit response to posts published before a given ISO8601 compliant date.'=>'ለዚህ ጥያቄ የሚሰጡት ምላሽ አይ ኤስ ኦ8601 አቤቱታ የሚቀርብበት ቀን ከመድረሱ በፊት ታትሞ የወጣ ነው ።','Ensure result set excludes specific IDs.'=>'ውጤት የተወሰኑ መታወቂያዎችን ማውጣቱን ያረጋግጡ ።','Limit result set to specific IDs.'=>'የተወሰኑ መታወቂያዎች ላይ የተዋቀረ ውጤት ።','Order sort attribute ascending or descending.'=>'የትእዛዝ አይነቶችን ወደ ላይ ወይም ወደ ታች ደርድር ።','Sort collection by object attribute.'=>'ስብስብ በነገር ኣባሪ ደርድር ።','Limit result set to comments of specific parent IDs.'=>'የተለዩ የወላጆች መታወቂያ አስተያየቶች ላይ ገደብ ተዋቀረ ።','Ensure result set excludes specific parent IDs.'=>'ውጤት የተወሰኑ የወላጆች መታወቂያዎችን ማስቀረቱን ያረጋግጡ ።','Limit result set to comments assigned to specific post IDs.'=>'በተወሰኑ ድህረ መታወቂያዎች የተመደቡ አስተያየቶች ላይ የውጤት መጠን ወሰን ።','Limit result set to comments assigned a specific status. Requires authorization.'=>'የተወሰነ አቋም በሚመደብላቸው አስተያየቶች ላይ የውሂብ ውጤት ተዋቀረ ። ፈቃድ ይጠይቃል ።','Limit result set to comments assigned a specific type. Requires authorization.'=>'የተወሰነ ዓይነት የተመደቡ አስተያየቶች ላይ የውጤት ስብስብን አዘጋጅ ። ፈቃድ ይጠይቃል ።','Method \'%s\' not implemented. Must be overridden in subclass.'=>'ዘዴ \'%s\' አልተተገበረም ። በንኡስ ርእስ ውስጥ መጠለፍ አለበት ።','Current page of the collection.'=>'የአሁኑ የ ስብስብ ገጽ ።','Maximum number of items to be returned in result set.'=>'በውጤት ስብስብ ውስጥ የሚመለሱ ንጥሎች ከፍተኛ ቁጥር ነው ።','Limit results to those matching a string.'=>'ኅብረቁምፊን ለሚዛመዱ ውጤቶች ይገድቡ ።','Scope under which the request is made; determines fields present in response.'=>'ጥያቄው የቀረበበትን ይዳስሳል ፤ በምላሹ የሚገኙ መስኮችን ይወስናል ፡ ፡','Whether posts with this status should be private.'=>'ይህ ሁኔታ በሚታይበት ጊዜ ፖስተሮቹ በግል መቅረብ ይኖርባቸዋል ።','Whether posts with this status should be protected.'=>'እንዲህ ዓይነት አቋም ያላቸው ፖስታዎች ጥበቃ ሊደረግላቸው ይገባል ።','Whether posts of this status should be shown in the front end of the site.'=>'የዚህ ሁኔታ አቀማመጥ በጣቢያው የፊት ገጽ ላይ መታየት ይኖርበታል ።','Whether posts with this status should be publicly-queryable.'=>'እንዲህ ዓይነት አቋም ያላቸው ፖስታዎች በይፋ መጠራጠር ይኖርባቸዋል ።','Whether to include posts in the edit listing for their post type.'=>'ፖስታውን በአርትዖት ዝርዝሩ ውስጥ ፖስታዎች ስለመጻፍ','All capabilities used by the taxonomy.'=>'በታክሲው የተጠቀሙ ሁሉም ችሎታዎች ።','A human-readable description of the taxonomy.'=>'ስለ ቀረጥ ሰብሳቢው የሚገልጽ ሕያው ማስረጃ ።','Whether or not the taxonomy should have children.'=>'ቀረጥ ሰብሳቢው ልጆች ይኑሩት አይኑሩት ።','Human-readable labels for the taxonomy for various contexts.'=>'ለተለያዩ ጉዳዮች ቀረጥ ሰብሳቢ ሲባል ሰው የሚነበብባቸው ላቦራቶሪዎች ።','The password for the post if it is password protected.'=>'የይለፍ ቃል የተጠበቀ ከሆነ የፖስታውን ይለፍ ቃል ።','You need to define a search term to order by relevance.'=>'ስርዓት ለመዘርጋት የፍለጋ ቁጥር መወሰን አለብህ ።','Incorrect post password.'=>'ትክክል ያልሆነ የፖስታ የይለፍ ቃል ።','Cannot create existing post.'=>'አሁን ያለውን ፖስት መፍጠር አልተቻለም ።','Sorry, you are not allowed to manage this plugin.'=>'ይቅርታ ፣ ይህን ፕሉጊን ለማስተዳደር አልተፈቀደም ።','Sorry, you are not allowed to edit comments.'=>'ይቅርታ ፣ አስተያየቶችን አርትዕ ለማድረግ አልተፈቀደም ።','The post has already been deleted.'=>'ፖስታው ቀድሞውኑ ተሰርዟል ።','A post can not be sticky and have a password.'=>'ፖስት ተለጣፊ ሊሆን እና የይለፍ ቃል ሊኖረው አይችልም ።','A sticky post can not be password protected.'=>'ተለጣፊ ፖስት በይለፍ ቃል የተጠበቀ ሊሆን አይችልም ።','A password protected post can not be set to sticky.'=>'በይለፍ ቃል የተጠበቀ ፖስት ሊጣበቅ አይችልም ።','Invalid post parent ID.'=>'ልክ ያልኾነ የድህረ ገጽ መታወቂያ ።','Invalid featured media ID.'=>'ልክ ያልኾነ የጊዜ ሰሌዳ ያለው የሚዲያ መታወቂያ ።','The title for the object.'=>'የነገሩ ርእስ ።','Whether the content is protected with a password.'=>'ይዘቱ በይለፍ ቃል የተጠበቀ ይሁን ።','Whether the excerpt is protected with a password.'=>'የመግቢያው ቁልፍ በይለፍ ቃል የተጠበቀ ይሁን ።','Limit result set to posts assigned to specific authors.'=>'በተወሰኑ ደራሲዎች የተመደቡ ፖስታዎች ላይ የተወሰነ መጠን ያለው ውጤት እንዲመዘገብ አድርጓል ።','Ensure result set excludes posts assigned to specific authors.'=>'ለተወሰኑ ደራሲዎች የተመደቡ ፖስታዎች መውጣታቸውን ያረጋግጡ ።','Limit result set to posts with a specific menu_order value.'=>'የቅደም ተከተል እሴት ያላቸው ፖስታዎች የተወሰነ መጠን ያለው የወሰን ውጤት ያስቀምጣል ።','Offset the result set by a specific number of items.'=>'በተወሰኑ ንጥሎች የተዘጋጀውን ውጤት ያጣጥሙ ።','Limit result set to items with particular parent IDs.'=>'በተለይም የወላጅ መታወቂያ ያላቸው ንጥል ነገሮች ላይ የውጤት መጠን ተዋቅሯል ።','Limit result set to all items except those of a particular parent ID.'=>'ከ ልዩ የወላጅ መታወቂያ ካልሆኑ በስተቀር ሁሉም ንጥል ነገሮች ላይ የወሰን ውጤት ተዘጋጅቷል ።','Limit result set to items except those with specific terms assigned in the %s taxonomy.'=>'በ %s ታክስ አኃዝ ውስጥ ከተመደቡት የተለየ ስም ካላቸው በስተቀር ለ ንጥል ነገሮች የተገደበ ውጤት ።','Limit result set to items that are sticky.'=>'ለጣቂ ንጥሎች ገደብ የውጤት ስብስብ ።','Invalid revision ID.'=>'ልክ ያልኾነ የስረዛ መታወቂያ ።','The %s property has an invalid stored value, and cannot be updated to null.'=>'%s ባህርይ ልክ ያልኾነ የተከማቸ እሴት አለው ፣ እናም ወደ null ሊዘምን አይችልም ።','Whether or not the term cloud should be displayed.'=>'ደመና የሚለው ቃል መታየት ይኖርበታል ።','Limit results to taxonomies associated with a specific post type.'=>'ውጤቶቹን በተወሰነ የፖስታ አይነት ጋር ተያይዘው ለሚመጡ ታክሶች ይገድቡ ።','Required to be true, as users do not support trashing.'=>'ተጠቃሚዎቹ ቆሻሻ ማስወገጃዎችን እንደማይደግፉ ሁሉ እውነት መሆን ያስፈልጋል ።','Unique identifier for the user.'=>'ለተጠቃሚው ልዩ መለያ','Number of published posts for the term.'=>'ለጊዜዉ የተመደቡ ጽሑፎች ብዛት','HTML description of the term.'=>'ኤችቲኤምኤል ስለ ቃሉ መግለጫ ።','An alphanumeric identifier for the term unique to its type.'=>'ቃሉ በዓይነቱ ልዩ የሆነ ፊደል ተራ ትርጉም አለው ።','Type attribution for the term.'=>'ለጊዜውም ቢሆን ምልክቶችን ተይብ ።','Sort collection by term attribute.'=>'ስብስብ በአንቀጽ ደርድር ።','Whether to hide terms not assigned to any posts.'=>'በመደበቂያዎች ላይ የሰፈረውን ሐሳብ መደበቅ ይኖርብሃል ።','Limit result set to terms assigned to a specific parent.'=>'በአንድ ወላጅ ላይ የተመደቡ ቃላትን ብዛት ገደብ አብጅ ።','Limit result set to terms assigned to a specific post.'=>'ለአንድ የተወሰነ ድህረ ገጽ የተመደቡ ቃላትን የወሰነ ውጤት ።','Sorry, you are not allowed to delete this revision.'=>'ይቅርታ ፣ ይህን ማሻሻያ እንድትሰርዝ አልተፈቀደም ።','Sorry, you are not allowed to edit roles of this user.'=>'ይቅርታ ፣ የዚህን ተጠቃሚ ሚናዎች አርትዕ እንዲያደርጉ አልተፈቀደም ።','Invalid user ID for reassignment.'=>'ልክ ያልኾነ የተጠቃሚ መታወቂያ ለግድብ ።','The role %s does not exist.'=>'ይህ %s የለም ።','All capabilities assigned to the user.'=>'ሁሉም ብቃቶች ለተጠቃሚው የተመደቡ ናቸው ።','Any extra capabilities assigned to the user.'=>'ማንኛውም ተጨማሪ ችሎታ ለተጠቃሚው የተመደበ ነው ።','Limit result set to users matching at least one specific role provided. Accepts csv list or single role.'=>'የተጠቃሚዎች ቢያንስ አንድ የተወሰነ ሚና በማዛመድ ላይ የተዋቀረ የወሰን ውጤት ። Csv ዝርዝር ወይም ነጠላ ሚና መቀበል ።','Could not delete meta value from database.'=>'ከ ውሂብ ጎታ ላይ የmetry እሴት መሰረዝ አልተቻለም ።','Meta fields.'=>'የሜታ መስኮች ።','Sorry, trackbacks are closed for this item.'=>'ይቅርታ ፣ ለዚህ ንጥል መከታተያ ቦታዎች ተዘግተዋል ።','Limit result set to posts with one or more specific slugs.'=>'አንድ ወይም ከዚያ በላይ ዝርዝር ስላይዶች የያዙ ፖስታዎች ላይ ገደብ ያለው ውጤት ተዘጋጅቷል ።','Taxonomies associated with post type.'=>'ከ ድህረ ገፅ አይነት ጋር የተዛመዱ ታክሲዎች ።','Comment field exceeds maximum length allowed.'=>'የአስተያየት መስክ ከተፈቀደው ከፍተኛ ርዝመት በላይ ነው ።','Limit result set to posts assigned one or more statuses.'=>'ለአንድ ወይም ከዚያ በላይ የተመደቡ ኹነቶች ላይ የወሰን ውጤት ተዘጋጅቷል ።','The comment does not support trashing. Set \'%s\' to delete.'=>'አስተያየቱ ቆሻሻን አይደግፍም ። ለመሰረዝ \'%s\' ን አዘጋጅ ።','The post does not support trashing. Set \'%s\' to delete.'=>'ፖስታው ቆሻሻ መጣያዎችን አይደግፍም ። ለመሰረዝ \'%s\' ን አዘጋጅ ።','Revisions do not support trashing. Set \'%s\' to delete.'=>'አንዳንድ ጊዜ ደግሞ \'እኔ ያልኩት ካልሆነ በስተቀር "የሚል ደንብ ማውጣት አይቻልም ። ለመሰረዝ \'%s\'ን አዘጋጅ ።','Users do not support trashing. Set \'%s\' to delete.'=>'ተጠቃሚዎች ቆሻሻን አይደግፉም ። ለመሰረዝ \'%s\' ን አዘጋጅ ።','Caption for the attachment, as it exists in the database.'=>'በውሂብ ጎታው ውስጥ እንዳለ ፣ ለአባሪ መግለጫ ።','HTML caption for the attachment, transformed for display.'=>'ለማሳየት የተሸጋገረው HTML ቁራጭ ለአባሪ እይታ ።','REST base route for the taxonomy.'=>'REST ላይ የተመሠረተው አቅጣጫ ።','Invalid user parameter(s).'=>'ልክ ያልሆነ የተጠቃሚ ግቤት (ዎች) ።','Reassign the deleted user\'s posts and links to this user ID.'=>'የተሰረዙትን ተጠቃሚ ፖስታዎችና አገናኞች ወደዚህ የተጠቃሚ መታወቂያ እንደገና ያዘጋጁ ።','Sorry, you are not allowed to assign the provided terms.'=>'ይቅርታ ፣ የቀረቡትን ቃሎች እንድትመድብ አልተፈቀደልህም ።','Sorry, you are not allowed to read comments without a post.'=>'ይቅርታ ፣ ያለ ፖስታ አስተያየት እንዲያነቡ አልተፈቀደም ።','Sorry, you are not allowed to read this comment.'=>'ይቅርታ ፣ ይህን አስተያየት እንድታነብ አልተፈቀደልህም ።','Sorry, you are not allowed to read the post for this comment.'=>'ይቅርታ ፣ ለዚህ አስተያየት ድህረ ገጽ እንዲያነቡ አልተፈቀደም ።','Sorry, you are not allowed to edit \'%s\' for comments.'=>'ይቅርታ ፣ ለአስተያየቶች \'%s\' ን አርትዕ ማድረግ አልተፈቀደም ።','Sorry, you are not allowed to create this comment without a post.'=>'ይቅርታ ፣ ያለ ፖስታ ይህንን አስተያየት መፍጠር አልተፈቀደም ።','Sorry, you are not allowed to create a comment on this post.'=>'ይቅርታ ፣ በዚህ ፖስት ላይ አስተያየት እንዲፈጥሩ አልተፈቀደም ።','Sorry, you are not allowed to view revisions of this post.'=>'ይቅርታ ፣ የዚህን ድህረ ስረዛ መመልከት አልተፈቀደም ።','Sorry, you are not allowed to filter users by role.'=>'ይቅርታ ፣ በሚና ተጠቃሚዎችን እንዲያጣሩ አልተፈቀደም ።','Sorry, you are not allowed to change the comment type.'=>'ይቅርታ ፣ የአስተያየት አይነቱን መለወጥ አልተፈቀደም ።','Recent Comments'=>'የቅርብ ጊዜ አስተያየቶች','Invalid slug.'=>'ልክ ያልኾነ ስላግ።','Cannot create a comment with that type.'=>'በዚያ አይነት አስተያየት መፍጠር አልተቻለም ።','The attachment caption.'=>'የአባሪ መግለጫ','The attachment description.'=>'የአባሪ መግለጫ ።','The attachment MIME type.'=>'የአባሪ MIME አይነት ።','URL to the original attachment file.'=>'URL ወደ ዋናው አባሪ ፋይል ።','The title for the status.'=>'የኹኔታው ርዕስ ።','The title for the post type.'=>'የፖስታ አይነት ርእስ ።','The title for the taxonomy.'=>'የታክሲማው ርዕስ ።','Types associated with the taxonomy.'=>'ከግብር አከፋፈል ጋር የተያያዙ ዓይነቶች ።','Term does not exist.'=>'ቃል የለም ።','Sorry, you are not allowed to view themes.'=>'ይቅርታ ፣ ገጽታዎችን ማየት አልተፈቀደም ።','The term cannot be deleted.'=>'ቃሉ ሊሰረዝ አይችልም ።','URL of the term.'=>'የቃሉ ኡርኤል ።','HTML title for the term.'=>'HTML ለቃሉ አርእስት ።','The parent term ID.'=>'የወላጅ ስም መታወቂያ ።','Author URL of the user.'=>'የተጠቃሚ URL ጸሃፊ','Locale for the user.'=>'ለተጠቃሚው የሚሆን ቦታ ።','Avatar URLs for the user.'=>'አቫታር ዩአርኤል ለተጠቃሚው ።','Limit response to comments published after a given ISO8601 compliant date.'=>'ISO8601 አቤቱታ የቀረበበት ቀን ከተሰጠ በኋላ የታተሙ አስተያየቶች የሚሰጡት ምላሽ ውስን ነው ።','Limit response to comments published before a given ISO8601 compliant date.'=>'ከመሰጠቱ በፊት የታተሙ አስተያየቶች የሚሰጡትን ምላሽ ቁጥር መቀነስ ።','An alphanumeric identifier for the status.'=>'ለኹኔታው በፊደል ተራ ቁጥር ምልክት የተሰጠ ሰው ነው ።','All capabilities used by the post type.'=>'ድህረ-አይነቱ ጥቅም ላይ የዋሉ ሁሉም ችሎታዎች ።','A human-readable description of the post type.'=>'የፖስታውን ዓይነት ሰው ሠራሽ መግለጫ ።','Whether or not the post type should have children.'=>'የድህረ ገጹ ዓይነት ልጆች ይኑሩህ አይኑሩህ ።','Human-readable labels for the post type for various contexts.'=>'ለተለያዩ ጽሑፎች ድህረ ገጽ ሰብዓዊ ተነባቢ ላቦራቶሪዎች','An alphanumeric identifier for the post type.'=>'የፖስታ አይነት የፊደል ቁጥር መለያ','REST base route for the post type.'=>'ድህረ ገጹ ዓይነት ማረፊያ መስመር ።','Required to be true, as revisions do not support trashing.'=>'አንድ ሰው በስሜት ተገፋፍቶ እርምጃ መውሰዱን እንደማይደግፍ ሁሉ ማስተካከያዎች ሲደረጉም ሁኔታው ተመሳሳይ ነው ።','An alphanumeric identifier for the taxonomy.'=>'ቀtaxonomy በፊደል ተራ ቁጥር ምልክት የሚያሳይ ምልክት ።','Required to be true, as terms do not support trashing.'=>'ቃሉ ቆሻሻን የማይደግፍ በመሆኑ እውነት መሆን ነበረበት ።','Unique identifier for the term.'=>'ለቃሉ የተለየ ትርጉም ይሰጣል ።','The password for the parent post of the comment (if the post is password protected).'=>'ለአስተያየት ድህረ ገጽ ወላጅ የይለፍ ቃል (ድህረ ገጹ በይለፍ ቃል የተጠበቀ ከሆነ) ።','All features, supported by the post type.'=>'ሁሉም ባህሪዎች ፣ በድህረ-ገጹ አይነት የተደገፉ ናቸው ።','You need to define an include parameter to order by include.'=>'የስርዓት ማካተት ግቤት በ ማካተት አለብዎት ።','The page number requested is larger than the number of pages available.'=>'የተጠየቀው የገጽ ቁጥር ከተገኘው የገጽ ቁጥር ይበልጣል ።','Limit result set to terms with one or more specific slugs.'=>'ከአንድ ወይም ከአንድ በላይ ዝርዝር ተንሸራታቾች ጋር ለማክበር የውጤት መጠን ተዋቅሯል ።','Limit result set to users with one or more specific slugs.'=>'አንድ ወይም ከዚያ በላይ የተወሰኑ ስላይዶች ይዘው ለተጠቃሚዎች የተዋቀረ የወሰን ውጤት ።','Displays an audio player.'=>'የድምጽ ማጫወቻን ያሳያል ።','Audio Widget'=>'የድምፅ መውረጃ','URL to the %s audio source file'=>'Url ወደ %s የድምጽ ምንጭ ፋይል','Unable to preview media due to an unknown error.'=>'ባልታወቀ ስሕተት ምክንያት ሚዲያውን ቀድሞ ማየት አልተቻለም ።','Displays an image.'=>'ምስል ያሳያል ።','Image Widget'=>'የምስል መውረጃ','Displays a video from the media library or from YouTube, Vimeo, or another provider.'=>'ከመገናኛ ብዙሃን ማከማቻ ወይም ከዩትዩብ ፣ ቪሜኦ ወይም ከሌላ አቅራቢ ቪዲዮ ያሳያል ።','Video Widget'=>'ቪዲዮ መውጫ','URL to the %s video source file'=>'URL ወደ %s የ ቪዲዮ ምንጭ ፋይል','A media item.'=>'የሚዲያ ነገር ።','Add to Widget'=>'ወደ ድርሰት አክል','Media Widget'=>'የሚዲያ ጥበብ','Attachment post ID'=>'አባሪ ድህረ መታወቂያ','URL to the media file'=>'URL ለመገናኛ ብዙሃን ፋይል','Title for the widget'=>'የርእስ ማውጫ','Greetings Network Administrator!'=>'የኔትወርክ አስተዳዳሪን ሰላምታ አቅርብ','The network currently disallows registrations.'=>'አውታረ መረቡ በአሁኑ ጊዜ ምዝገባዎችን ያስወግዳል ።','The network currently allows site registrations.'=>'አውታረ መረቡ በአሁኑ ጊዜ የጣቢያ ምዝገባዎችን ይፈቅዳል ።','The network currently allows user registrations.'=>'አውታረ መረቡ አሁን የተጠቃሚ ምዝገባዎችን ይፈቅዳል ።','The network currently allows both site and user registrations.'=>'አውታረ መረቡ በአሁኑ ጊዜ ሁለቱም የጣቢያ እና የተጠቃሚ ምዝገባዎችን ይፈቅዳል ።','Show tag counts'=>'የመለያ ቁጥር አሳይ','Arbitrary HTML code.'=>'አግዳሚው HTML ኮድ ።','Some HTML tags are not permitted, including:'=>'አንዳንድ የHTML መለያዎች አይፈቀዱም ፣ ጨምሮ ፣','Arbitrary text.'=>'አርቃቂ ቃላትን መጠቀም ።','This widget may contain code that may work better in the &#8220;Custom HTML&#8221; widget. How about trying that widget instead?'=>'ይህ ወርድ በ & # 8220 ፤ ብጁ HTML እና # 8221 ፤ መሰረትም የተሻለ መስራት የሚችል ኮድ ይዟል ። በምትኩ ሚስቱን ለማበረታታት መሞከርስ?','New Custom HTML Widget'=>'አዲስ ብጁ HTML ጥበብ','Did you know there is a &#8220;Custom HTML&#8221; widget now? You can find it by scanning the list of available widgets on this screen. Check it out to add some custom code to your site!'=>'&#8220;ብጁ HTML&#8221; አሁን ቁመት እንዳለ ታውቃለህ? በዚህ ማያ ገጽ ላይ ያሉትን የሚገኙ መገልገያዎች ዝርዝር በመቃኘት ሊያገኙት ይችላሉ ። ወደ ጣቢያዎ አንዳንድ ብጁ ኮድ ለማከል ይፈትሹት!','Hey there, looks like you just pasted HTML into the &#8220;Visual&#8221; tab of the Text widget. You may want to paste your code into the &#8220;Text&#8221; tab instead. Alternately, try out the new &#8220;Custom HTML&#8221; widget!'=>'እዚያ ውስጥ HTML በ &#8220;Visual&#8221; ፤ የጨርቃጨርቅ መወጣጫ ታብ የለቃችሁ ይመስላል ። ኮድዎን &#8220;ጽሁፍ&#8221; በምትኩ ትር ለመለጠፍ ይፈልጋሉ ። ሌላው አማራጭ ፣ አዲሱን &#8220;ብጁ HTML&#8221; ጨርስ!','Method \'%s\' must be overridden.'=>'ዘዴ \'%s\' መደበቅ አለበት ።','You are using a browser that does not have Flash player enabled or installed. Please turn on your Flash player plugin or download the latest version from https://get.adobe.com/flashplayer/'=>'የፍላሽ ተጫዋች የነቃ ወይም ያልተጫነበት አሳሽ እየተጠቀምክ ነው ። እባክዎ የፍላሽ ተጫዋች ፕሉጊን ያብሩ ወይም የቅርብ ጊዜውን ስሪት ከ https://get.adobe.com/flashplayer/','Live Broadcast'=>'የቅጥታ ስርጭት','Activate &amp; Publish'=>'ንቁ &amp; አተም','Please save your changes in order to share the preview.'=>'እባክዎ ቅድመ ዕይታውን ለማጋራት ለውጦችዎን ያስቀምጡ ።','Downloading your new theme&hellip;'=>'አዲሱን ገጽታዎን እና ሲኦልፖንሰር ማድረግ ፣','Setting up your live preview. This may take a bit.'=>'የቀጥታ ቅድመ ዕይታዎን በማቀናበር ላይ ። ይህ ትንሽ ሊወስድ ይችላል ።','Reverting unpublished changes&hellip;'=>'ያልታተሙ ለውጦችን እና የሲኦልፖን አድራሻ በመመለስ ፣','&larr; Go to Link Categories'=>'እና እጭ ፤ ወደ አገናኝ ምድቦች ሂድ','Use the Custom HTML widget to add arbitrary HTML code to your widget areas.'=>'አግዳሚው HTML ኮድ ወደ መውጫ አካባቢዎችዎ ለማከል ብጁ HTML ወርድ ይጠቀሙ ።','Custom HTML Widget'=>'ብጁ HTML ዊጂት','%d results found. Use up and down arrow keys to navigate.'=>'%d ውጤቶች ተገኝተዋል ። ለማሰስ የላይ እና የታች ቀስት ቁልፎችን ይጠቀሙ።','Terms do not support trashing. Set \'%s\' to delete.'=>'ቃላቱ ቆሻሻ መጣልን አይደግፉም ። ለመሰረዝ \'%s\' ን አዘጋጅ።','Does the user %1$s have permission to use the %2$s database?'=>'ተጠቃሚው %1$s የውሂብ ጎታ ለመጠቀም %2$s  ፈቃድ አለው?','You have searched the %1$s blog archives for <strong>&#8216;%2$s&#8217;</strong>. If you are unable to find anything in these search results, you can try one of these links.'=>'የ ጦማር ማህደሮችን ፈትሸሃል ለ %1$s <strong>&#8216;%2$s&#8217;</strong>። በእነዚህ የፍለጋ ውጤቶች ውስጥ ምንም ነገር ማግኘት ካልቻሉ ፣ ከእነዚህ አገናኞች አንዱን መሞከር ይችላሉ ።','There doesn\'t seem to be a %s file. I need this before we can get started.'=>'የ %s ፋይል ያለ አይመስልም ። ከመጀመራችን በፊት ይህን እፈልጋለሁ ።','Your email address has not been updated yet. Please check your inbox at %s for a confirmation email.'=>'የኢሜይል አድራሻዎ እስካሁን ድረስ አልተዘመነም ። እባክዎ ለማረጋገጫ ኢሜይል በ %s የገቢ ሳጥንዎን ይፈትሹ ።','Query parameter not permitted: %s'=>'የጥያቄ መመጠኛ አልተፈቀደም ፥ %s','Unsupported value type (%s).'=>'ያልተደገፈ የእሴት አይነት (%s)።','Sorry, you are not allowed to edit the %s custom field.'=>'ይቅርታ ፣ %s ብጁ መስክን አርትዕ ለማድረግ አልተፈቀደም ።','Widgets need to be registered using %s, before they can be displayed.'=>'ድርጀቶች መታየት ከመጀመራቸው በፊት %s በመጠቀም መመዝገብ ያስፈልጋቸዋል ።','Skip to content'=>'ወደ ይዘት ዝለል','You are currently browsing the %1$s blog archives for the year %2$s.'=>'በአሁኑ ጊዜ የ%1$s ብሎግ ማህደሮችን ለ%2$s አመት እያሰሱ ነው።','Invalid Content-Disposition supplied. Content-Disposition needs to be formatted as `attachment; filename="image.png"` or similar.'=>'ልክ ያልሆነ ይዘት-አቀራረብ ቀርቧል። የይዘት-አቀማመጥ እንደ `አባሪ መቅረጽ አለበት፤ filename="image.png"` ወይም ተመሳሳይ። ','The date the post was published, as GMT.'=>'ልጥፉ የታተመበት ቀን፣ እንደ ጂኤምቲ።','The ID for the parent of the revision.'=>'ለክለሳ ወላጅ መታወቂያ። ','label for hide controls button without length constraintsHide Controls'=>'መቆጣጠሪያዎችን ደብቅ','label for hide controls button without length constraintsShow Controls'=>'መቆጣጠሪያዎችን አሳይ','Theme starter contentMonday&ndash;Friday: 9:00AM&ndash;5:00PM'=>'ሰኞ እና አርብ: 9:00AM&ndash;5:00PM','Theme starter contentSaturday &amp; Sunday: 11:00AM&ndash;3:00PM'=>'ቅዳሜ & amp; እሁድ፡ 11፡00AM&ndash;3፡00PM ','Theme starter contentThis may be a good place to introduce yourself and your site or include some credits.'=>'ይህ እራስዎን እና ጣቢያዎን ለማስተዋወቅ ወይም አንዳንድ ክሬዲቶችን ለማካተት ጥሩ ቦታ ሊሆን ይችላል።','Theme starter contentFoursquare'=>'አራት ካሬ','Theme starter contentPinterest'=>'Pinterest','Theme starter contentMeta'=>'ሜታ ','Theme starter contentRecent Comments'=>'የቅርብ ጊዜ አስተያየቶች ','Theme starter contentWelcome to your site! This is your homepage, which is what most visitors will see when they come to your site for the first time.'=>'እንኳን ወደ ጣቢያዎ በደህና መጡ! ይህ የእርስዎ መነሻ ገጽ ነው፣ ይህም አብዛኛዎቹ ጎብኚዎች ለመጀመሪያ ጊዜ ወደ እርስዎ ጣቢያ ሲመጡ የሚያዩት ነው።','Theme starter contentYou might be an artist who would like to introduce yourself and your work here or maybe you&rsquo;re a business with a mission to describe.'=>'እራስህን እና ስራህን እዚህ ማስተዋወቅ የምትፈልግ አርቲስት ልትሆን ትችላለህ ወይም ደግሞ የመግለጽ ተልዕኮ ያለው ንግድ ነህ።','Theme starter contentThis is a page with some basic contact information, such as an address and phone number. You might also try a plugin to add a contact form.'=>'ይህ እንደ አድራሻ እና ስልክ ቁጥር ያሉ አንዳንድ መሰረታዊ የእውቂያ መረጃ ያለው ገጽ ነው። የእውቂያ ቅጽ ለመጨመር ፕለጊን መሞከርም ይችላሉ።','Theme starter contentThis is an example of a homepage section. Homepage sections can be any page other than the homepage itself, including the page that shows your latest blog posts.'=>'ይህ የመነሻ ገጽ ክፍል ምሳሌ ነው። የመነሻ ገጽ ክፍሎች ከመነሻ ገጹ ሌላ ማንኛውም ገጽ ሊሆኑ ይችላሉ፣ ይህም የቅርብ ጊዜዎቹን የብሎግ ልጥፎችዎን የሚያሳየውን ገጽ ጨምሮ። ','Audio Widget (%d)'=>'የድምጽ መግብር (%d) ' . "\0" . 'የድምጽ መግብሮች (%d) ','label for button in the gallery widget; should not be longer than ~13 characters longEdit Gallery'=>'ጋለሪ አርትዕ','label for button in the image widget; should preferably not be longer than ~13 characters longReplace Image'=>'ምስል ተካ ','label for button in the image widget; should preferably not be longer than ~13 characters longEdit Image'=>'ምስል አርትዕ','Image Widget (%d)'=>'የምስል መግብር (%d)' . "\0" . 'የምስልች መግብር (%d)','label for button in the gallery widget; should not be longer than ~13 characters longAdd Images'=>'ምስል አክል','label for button in the video widget; should preferably not be longer than ~13 characters longReplace Video'=>'ቪዲዮ ተካ','label for button in the video widget; should preferably not be longer than ~13 characters longEdit Video'=>'ቪዲዮ አርትዕ','Video Widget (%d)'=>'የቪዲዮ መግብር (%d) ' . "\0" . 'የቪዲዮዎች መግብር (%d) ','label for button in the media widget; should preferably not be longer than ~13 characters longEdit Media'=>'ሚዲያ አርትዕ','Media Widget (%d)'=>'የሚዲያ ምግብር (%d) ' . "\0" . 'የሚዲያዎች ምግብር (%d) ','To change or disable registration go to your <a href="%s">Options page</a>.'=>'ምዝገባን ለመቀየር ወይም ለማሰናከል ወደ <a href="%s">የአማራጮች ገጽ</a> ይሂዱ።','label for button in the video widgetAdd Video'=>'ቪዲዮ ያክሉ','Did you know there is a &#8220;Custom HTML&#8221; widget now? You can find it by pressing the &#8220;<a class="add-widget" href="#">Add a Widget</a>&#8221; button and searching for &#8220;HTML&#8221;. Check it out to add some custom code to your site!'=>'ብጁ HTML እንዳለ ያውቃሉ & # 8220; አሁን መግብር? & # 8220;<a class="add-widget" href="#">መግብር አክል</a>ን በመጫን ሊያገኙት ይችላሉ። አዝራር እና መፈለግ & # 8220;HTML & # 8221 ;። አንዳንድ ብጁ ኮድ ወደ ጣቢያዎ ለማከል ይመልከቱት! ','There is a more recent autosave of your changes than the one you are previewing. <a href="%s">Restore the autosave</a>'=>'በቅድመ-እይታ ከምትመለከቱት የበለጠ የቅርብ ጊዜ በራስሰር ማስቀመጥ አለ። <a href="%s">ራስ ማስቀመጥን ወደነበረበት ይመልሱ</a>','There is %d error which must be fixed before you can save.'=>'ማስቀመጥ ከመቻልዎ በፊት መስተካከል ያለበት %d ስህተት አለ።' . "\0" . 'ማስቀመጥ ከመቻልዎ በፊት መስተካከል ያለባቸው %d ስህተቶች አሉ።','Schedule your customization changes to publish ("go live") at a future date.'=>'የማበጀት ለውጦችዎን ወደፊት ለማተም ("ቀጥታ ቀጥል") ቀጠሮ ይያዙ።','Looks like something&#8217;s gone wrong. Wait a couple seconds, and then try again.'=>'የሆነ ችግር የተፈጠረ ይመስላል &#8211; ጥቂት ሰከንዶች ይጠብቁ እና ከዚያ እንደገና ይሞክሩ።','%s has taken over and is currently customizing.'=>'%s ተረክቧል እና በአሁኑ ጊዜ በማበጀት ላይ ነው።','Add a navigation menu to your sidebar.'=>'ወደ የጎን አሞሌዎ የአሰሳ ምናሌ ያክሉ።','Change'=>'ቀይር ','The template cannot be deleted.'=>'አብነቱ ሊሰረዝ አይችልም።','Sorry, you are not allowed to view menu items.'=>'ይቅርታ፣ የምናሌ ንጥሎችን እንድትመለከት አልተፈቀደልህም።','The query does not contain the correct number of placeholders (%1$d) for the number of arguments passed (%2$d).'=>'መጠይቁ ላለፉት ነጋሪ እሴቶች (%2$d) ትክክለኛ የቦታ ያዥዎች ቁጥር (%1$d) አልያዘም።','Howdy ###USERNAME###,

