###SITEURL###','Sorry, you are not allowed to query users by this parameter.'=>'ይቅርታ ፣ ተጠቃሚዎችን በዚህ ልኬት እንዲያዙ አይፈቀድልዎትም።','Export Personal Data'=>'የግል ውሂብ ኤክስፖርት አድርግ','Thanks for confirming your export request.'=>'ወደ ውጭ መላኪያ ጥያቄዎን ስላረጋገጡ እናመሰግናለን።','The site administrator has been notified. You will receive a link to download your export via email when they fulfill your request.'=>'የጣቢያው አስተዳዳሪ እንዲያውቅ ተደርጓል። ጥያቄዎን ሲያሟሉ ወደ ውጭ የሚላኩዎትን በኢሜል ለማውረድ አገናኝ ይደርስዎታል።','Thanks for confirming your erasure request.'=>'የመደምሰስ ጥያቄዎን ስላረጋገጡ እናመሰግናለን።','The site administrator has been notified. You will receive an email confirmation when they erase your data.'=>'የጣቢያው አስተዳዳሪ እንዲያውቅ ተደርጓል። ውሂብዎን ሲሰርዙ የኢሜይል ማረጋገጫ ይደርስዎታል።','Not enough space to upload. %s KB needed.'=>'ለመስቀል በቂ ቦታ የለም። %s KB ያስፈልጋል።','You have used your space quota. Please delete files before uploading.'=>'የጠፈር ኮታህን ተጠቅመሃል። እባክዎ ከመጫንዎ በፊት ፋይሎችን ይሰርዙ።','The current user can publish this post.'=>'የአሁኑ ተጠቃሚ ይህን ልጥፍ ማተም ይችላል።','The current user can sticky this post.'=>'የአሁኑ ተጠቃሚ ይህን ልጥፍ ማጣበቅ ይችላል።','The current user can change the author on this post.'=>'የአሁኑ ተጠቃሚ በዚህ ልጥፍ ላይ ደራሲውን መቀየር ይችላል።','The current user can assign terms in the %s taxonomy.'=>'የአሁኑ ተጠቃሚ በ%s ታክሶኖሚ ውስጥ ውሎችን መመደብ ይችላል።','The current user can create terms in the %s taxonomy.'=>'የአሁኑ ተጠቃሚ በ%s ታክሶኖሚ ውስጥ ውሎችን መፍጠር ይችላል።','Unable to send personal data export confirmation email.'=>'የግል ውሂብ ወደ ውጭ የመላክ ማረጋገጫ ኢሜይል መላክ አልተቻለም።','The offset number requested is larger than or equal to the number of available revisions.'=>'የተጠየቀው የማካካሻ ቁጥሩ ከተገኙት ክለሳዎች ብዛት ይበልጣል ወይም እኩል ነው።','Object type.'=>'ቁስ ዓይነት።','The query only expected one placeholder, but an array of multiple placeholders was sent.'=>'መጠይቁ የሚጠበቀው አንድ ቦታ ያዥ ብቻ ነው፣ ነገር ግን የበርካታ ቦታ ያዢዎች ድርድር ተልኳል።','Whether or not the post type can be viewed.'=>'የፖስታ አይነት ሊታይ ይችላል ወይም አይታይ።','Limit result set to users who are considered authors.'=>'ውጤቱን እንደ ደራሲ ለሚቆጠሩ ተጠቃሚዎች ገድብ።','Action has been confirmed.'=>'እርምጃ ተረጋግጧል።','GUID for the post, transformed for display.'=>'GUID ለፖስታ፣ ለእይታ የተለወጠ።','HTML excerpt for the post, transformed for display.'=>'ለማሳየት ወደተለወጠው ነገር HTML ውጣ።','HTML description for the attachment, transformed for display.'=>'HTML መግለጫ ለአባሪ ፣ ለእይታ ተለወጠ።','The ID of the featured media for the post.'=>'ለልዑክ ጽሑፉ ተለይቶ የቀረበው ሚዲያ መታወቂያ።','Description for the attachment, as it exists in the database.'=>'በመረጃ ቋቱ ውስጥ እንዳለ ስለ ዓባሪው መግለጫ።','Whether or not the post should be treated as sticky.'=>'ልጥፉ እንደ ተለጣፊ ተደርጎ መታየት አለበት ወይም አይሁን።','The terms assigned to the post in the %s taxonomy.'=>'በ%s ታክሶኖሚ ውስጥ ለፖስታው የተመደቡት ውሎች።','Excerpt for the post, as it exists in the database.'=>'በመረጃ ቋቱ ውስጥ እንዳለ ለፖስቱ የተቀነጨበ።','The globally unique identifier for the post.'=>'የልኡክ ጽሁፉ ዓለም አቀፍ ልዩ መለያ።','The date the revision was last modified, in the site\'s timezone.'=>'ክለሳው ለመጨረሻ ጊዜ የተሻሻለበት ቀን፣ በጣቢያው የሰዓት ሰቅ ውስጥ።','The date the revision was last modified, as GMT.'=>'ነገሩ መጨረሻ የተሻሻለበት ቀን እንደ ጂኤምቲ።','The date the revision was published, as GMT.'=>'ነገሩ የታተመበት ቀን እንደ GMT።','The date the revision was published, in the site\'s timezone.'=>'ነገሩ የታተመበት ቀን ፣ በጣቢያው የጊዜ ሰሌዳ ውስጥ ።','The theme file to use to display the post.'=>'ነገሩን ለማሳየት ለመጠቀም የገጽታ ፋይሉ።','The excerpt for the post.'=>'ነገሩን ለማገናዘብ ሞክር።','Whether or not comments are open on the post.'=>'አስተያየቶችም ይሁን አይሁኑ በነገሩ ላይ ክፍት ናቸው።','Avatar URLs for the comment author.'=>'አቫታር URL ለጉዳዩ ደራሲ።','State of the comment.'=>'የነገሩ ሁኔታ።','Title for the post, as it exists in the database.'=>'የነገሩ ርእስ ፣ በ ውሂብ ጎታው ውስጥ እንዳለ።','A named status for the post.'=>'የነገሩ ስም የተሰጠው ሁኔታ።','The format for the post.'=>'የነገሩ ቅርጸት።','The ID for the parent of the post.'=>'የነገሩ ወላጅ መታወቂያ።','An alphanumeric identifier for the revision unique to its type.'=>'የነገሩ ዓይነት የተለየ የፊደል ተራ መታወቂያ ነው።','The content for the post.'=>'የነገሩ ይዘት።','Content for the post, as it exists in the database.'=>'የነገሩ ይዘት ፣ በ ውሂብ ጎታው ውስጥ እንዳለ።','The ID for the author of the post.'=>'የነገሩ ደራሲ መታወቂያ።','URL for the comment author.'=>'የነገሩ ደራሲ URL','GUID for the revision, as it exists in the database.'=>'የነገሩ GUD በውሂብ ጎታው ውስጥ እንዳለ።','Display name for the comment author.'=>'የነገር ደራሲ ስም አሳይ።','User agent for the comment author.'=>'የነገር ደራሲ ተጠቃሚ ወኪል።','Email address for the comment author.'=>'የነገር ደራሲ የኢሜይል አድራሻ።','IP address for the comment author.'=>'የነገር ደራሲ IP አድራሻ።','Whether or not the post can be pinged.'=>'ይሁን አይሁን ነገሩን መልቀቅ ይቻላል።','Sign up'=>'ይመዝገቡ','HTML title for the post, transformed for display.'=>'HTML ቁመና ለነገሩ ፣ ለማሳያነት ተለውጧል።','HTML content for the post, transformed for display.'=>'HTML ይዘት ለነገሩ ፣ ለማሳያነት ተለውጧል።','Invalid type parameter.'=>'የተሻረ መለኪያ።','Limit result set to themes assigned one or more statuses.'=>'ለአንድ ወይም ከዚያ በላይ የተመደቡ ኹነቶች ላይ የወሰን ውጤት ተዘጋጅቷል።','Sorry, you are not allowed to read blocks of this post.'=>'እናዝናለን ፣ ፖስቱ ማንብብ አልተፈቀደለህም ።','Sorry, you are not allowed to read blocks as this user.'=>'ይቅርታ፥ እንደዚህ ተጠቃሚ ሆነው ፖስቶች ማንብብ አልተፈቀደለወትም።','Invalid block.'=>'የማይሰራ አምድ።','The site administrator has been notified and will fulfill your request as soon as possible.'=>'የጣቢያው አስተዳዳሪ አሳውቆ ፣ እናም ጥያቄህን በተቻለ ፍጥነት ይፈጽማል ። ','Invalid action name.'=>'ልክ ያልኾነ የድርጊት ስም ። ','There is no autosave revision for this post.'=>'ለዚህ ድህረ ገፅ የራስ ሰር የማስቀመጥ ማሻሻያ የለም ። ','Preview link for the post.'=>'ድህረ ገጹን አገናኝ ቅድመ እይታ ። ','There is nothing to save. The autosave and the post content are the same.'=>'ማዳን አይቻልም ። ራስ አስቀምጥ እና ድህረ ይዘቱ አንድ ናቸው ። ','Permalink template for the post.'=>'የፐርማል አገናኝ ዝግጁ ይዞታ ለ ድህረ ገጹ ። ','Slug automatically generated from the post title.'=>'ስሉግ በራስ ሰር ከፖስታ ርእስ የሚመነጭ ነው ። ','Version of the content block format used by the post.'=>'ድህረ ገጹ ጥቅም ላይ የዋለውን የይዘት ገደብ ቅርጸት ስሪት ። ','The current user can post unfiltered HTML markup and JavaScript.'=>'አሁን ያለው ተጠቃሚ ያልተመደበውን HTML ማርክፕ እና JavaScriptን መለጠፍ ይችላል ። ','Internal search handler error.'=>'የውስጥ ፍለጋ የእጅ ሰሌዳ ስህተት ። ','Limit results to items of an object type.'=>'የነገር አይነት ንጥል ነገሮች ላይ ውጤቶችን ይገድቡ ። ','Limit results to items of one or more object subtypes.'=>'ለአንድ ወይም ከዚያ በላይ የነገር ንዑስ አንቀጾች ንጥል ነገሮች ውጤቶች ይገድቡ ። ','The visibility settings for the taxonomy.'=>'ለታክሲው የተይታይነት ቅንጅቶች ። ','Features supported by this theme.'=>'ባህሪያት በዚህ ገጽታ የተደገፉ ናቸው ። ','Post formats supported.'=>'የድህረ ገጽ ቅጽ ተደግፏል ። ','Whether the theme supports responsive embedded content.'=>'ጭብጡ በምላሹ የተከተተ ይዘት ይደግፋል ወይ? ','Unique registered name for the block.'=>'ለእግዱ ልዩ የተመዘገበ ስም ። ','Attributes for the block.'=>'ስለ ጥግ ባህሪያት ። ','ID of the post context.'=>'የፖስታ አገባብ መታወቂያ ። ','The rendered block.'=>'የተተረጎመው እገዳ ። ','Sorry, you are not allowed to view autosaves of this post.'=>'ይቅርታ ፣ የዚህን ፖስት ራስ ሰርዞችን ማየት አልተፈቀደም ። ','Whether a taxonomy is intended for use publicly either via the admin interface or by front-end users.'=>'በአስተዳዳሪው በይነገጽ ወይም ከፊት ለፊት ባሉ ተጠቃሚዎች አማካኝነት በሕዝብ ፊት እንዲጠቀም የታሰበም ይሁን የግብር አከፋፈሉ ። ','Whether the taxonomy is publicly queryable.'=>'ቀረጥ ሰብሳቢው በሕዝብ ፊት መጠራጠር ይሁን ። ','Whether to generate a default UI for managing this taxonomy.'=>'ይህንን የግብር አከፋፈል ለማስተዳደር ነባሪ UI ማመንጨት ወይም ማመንጨት ። ','Whether to allow automatic creation of taxonomy columns on associated post-types table.'=>'በተዛማጅ ድህረ-አይነቶች ሰንጠረዥ ላይ የታክሲኖሚ አምዶች ራስ ሰር መፈጠር አለመፍቀድ ። ','Whether to make the taxonomy available for selection in navigation menus.'=>'በአሰሳ መዝገብ ውስጥ ለመምረጥ የታክስ አከፋፈሉን ማግኘት አለመቻል ። ','Whether to show the taxonomy in the quick/bulk edit panel.'=>'የግብር አርትዕን በ የፈጣን / አምፑል አርትዕ ክፍለ መቃን ማሳየት አለመቻል ። ','Usage of the title attribute on the login logo is not recommended for accessibility reasons. Use the link text instead.'=>'በሎሚ አርማ ላይ አርእስት መጠቀም ለተደራሽነት ምክንያቶች አይመከርም ። በምትኩ የአገናኝ ጽሑፉን ይጠቀሙ ። ','Recovery Mode Initialized. Please log in to continue.'=>'የማገገሚያ ሁነታ ተነሥቷል ። እባክዎ ለመቀጠል ይግቡ ። ','An incomplete personal data request for this email address already exists.'=>'ለዚህ የኢሜይል አድራሻ ያልተሟላ የግል ውሂብ ጥያቄ ቀድሞውኑ አለ ። ','Could not insert term taxonomy into the database.'=>'የጊዜ ገደብ ወደ ውሂብ ጎታው ማስገባት አልቻለም ። ','Entries feed'=>'ግብአት አስገባ ','Comments feed'=>'አስተያየቶች ግብአት ','Sorry, you are not allowed to delete revisions of this post.'=>'ይቅርታ ፣ የዚህን ፖስት ስረዛዎች ለመሰረዝ አልተፈቀደም ። ','Whether posts of this status may have floating published dates.'=>'ይህ ሁኔታ ከታተመባቸው ቀናት መካከል የተወሰኑት የሚንሳፈፉ ናቸው ። ','Sorry, marking a user as spam is only supported on Multisite.'=>'ይቅርታ ፣ ተጠቃሚን እንደ አይፈለጌ ምልክት ማድረግ በብዙዎች ላይ ብቻ የተደገፈ ነው ። ','Not enough data to create this user.'=>'ይህን ተጠቃሚ ለመፍጠር በቂ ውሂብ የለም ። ','User&#8217;s profile data.'=>'ተጠቃሚ&#8217; የመገለጫ ውሂብ ። ','Whether theme opts in to wide alignment CSS class.'=>'የገፅታ መረጣ በCSD ክፍል ውስጥ ለማሰለፍ የሚመረጥ ይሁን ። ','Whether posts and comments RSS feed links are added to head.'=>'ፖስታዎች እና አስተያየቶች የ RSS ምግብ አገናኞች ወደ ራስ ይታከላሉ ። ','Custom header if defined by the theme.'=>'በመልዕክት ከተበየነ ብጁ ርእስ ። ','Custom background if defined by the theme.'=>'በመልዕክት ከተበየነ ብጁ መደብ ። ','Custom logo if defined by the theme.'=>'በመልዕክት ከተበየነ ብጁ አርማ ። ','Whether the theme enables Selective Refresh for Widgets being managed with the Customizer.'=>'ጭብጡ መራጭ ምግቦችን ከጓደኛ ጋር በመመሳጠር እድሳት ለማድረግ የሚያስችል ይሁን ። ','Whether theme opts in to the dark editor style UI.'=>'ጭብጡ በጨለማው የአዘጋጁ ቅጥ UI ይኑር አይኑር ። ','Whether the theme disables custom colors.'=>'ጭብጡ ብጁ ቀለሞች ይኑሩበት ። ','Whether the theme disables custom font sizes.'=>'ጭብጡ ብጁ ቅርጸ ቁምፊ ዎችን ቢያሰናክልም ። ','Whether the theme disables custom gradients.'=>'ጭብጡ ብጁ ውጤት ተቀባዮችን ያሰናዳል ። ','Custom color palette if defined by the theme.'=>'ጭብጡ ከተተረጎመ ብጁ የቀለም ጣዕመ ዜማ ። ','Custom font sizes if defined by the theme.'=>'ብጁ ቅርጸ ቁምፊ በገጹ ከተበየነ ይሸፍናል ። ','Custom gradient presets if defined by the theme.'=>'በመልዕክት ከተበየነ ብጁ ደረጃ ይወስናል ። ','Whether theme opts in to the editor styles CSS wrapper.'=>'የገፅታ ገጽታ ወደ አርታኢ ቅጦች ውስጥ ይኑር አይኑር በCSS ጠቅል ። ','Allows use of HTML5 markup for search forms, comment forms, comment lists, gallery, and caption.'=>'ለመፈለግ ቅጾች ፣ አስተያየት ቅጾች ፣ የአስተያየት ዝርዝሮች ፣ የማእከለ ስእላት እና መግለጫዎች የ HTML ማኑካፕ መጠቀምን ይፈቅዳል ። ','Whether the theme can manage the document title tag.'=>'ጭብጡ የሰነድ አርእስት መለያውን ማስተዳደር ይችል እንደሆነ ። ','Limit result set based on relationship between multiple taxonomies.'=>'በበርካታ ታክሲዎች መካከል ባለው ግንኙነት መሰረት የወሰን ውጤት ተዘጋጅቷል ። ','Community Events Location'=>'የማህበረሰብ ክስተቶች አካባቢ ','User Agent'=>'የተጠቃሚ ወኪል ','Last Login'=>'የመጨረሻ መግቢያ ','Session Tokens'=>'ክፍለ ጊዜ ወደ ምስሎች ','User&#8217;s Session Tokens data.'=>'ተጠቃሚ እና # 8217 ፤ ዎቹ ወደ ምስጠራ መረጃ ','XML Sitemap'=>'Xml Sitap ','Learn more about XML sitemaps.'=>'ስለ XML መቀመጥ የበለጠ ይወቁ ። ','Last Modified'=>'በመጨረሻ የተለወጠ ','Change Frequency'=>'ድግግሞሽ ለውጥ ','Priority'=>'ቅድሚያ ','This image cannot be displayed in a web browser. For best results convert it to JPEG before uploading.'=>'ይህ ምስል በድር አሳሽ ውስጥ ሊታይ አይችልም ። ለተሻለ ውጤት ከመስቀልዎ በፊት ወደ JPEG ይለውጡት ። ','The post types that support thumbnails or true if all post types are supported.'=>'ሁሉም ድህረ ገጽ አይነቶች የሚደገፉ ከሆነ ጥፍር ወይም እውነትነት ያላቸውን ድህረ ገጽ አይነቶች ይለጥፋሉ ። ','RSS Feed'=>'Rss ምግብ ','Block name.'=>'ስም አግድ ። ','Sorry, you are not allowed to manage block types.'=>'ይቅርታ ፣ የእግድ አይነቶችን ለማስተዳደር አልተፈቀደም ። ','Invalid block type.'=>'ልክ ያልኾነ የግድ አይነት ። ','Title of block type.'=>'የታገደ አይነት ርእስ ። ','Unique name identifying the block type.'=>'የታገደውን አይነት ለመለየት ልዩ ስሙ ። ','Description of block type.'=>'የታገደ አይነት መግለጫ ። ','Icon of block type.'=>'የእግድ አይነት አዶ ። ','Block attributes.'=>'ባህሪያትን አግድ ። ','Context provided by blocks of this type.'=>'የዚህ አይነቱ ባለ ማዕድ የሚዘጋጅበት ዐውድ ። ','Context values inherited by blocks of this type.'=>'የዚህ አይነቱን ባሕርይ የሚወርሱ ነባራዊ እሴቶች ። ','Block supports.'=>'ድጋፎችን አግድ ። ','Block category.'=>'የእግድ ምድብ ። ','Is the block dynamically rendered.'=>'ይህ ምልክት ፊደላት ተቀርጾበታል ። ','Editor script handle.'=>'የአርታዒ ጽሑፍ እትም ። ','Public facing script handle.'=>'ፊት ለፊት የሚቆም ጽሑፍ እጀታ ። ','Editor style handle.'=>'የአዘጋጁ ቅጥ መያዣ ','Block style variations.'=>'ቅጥ ልዩነቶችን አግድ ። ','Unique name identifying the style.'=>'የአጻጻፍ ስልቱን ለይቶ ማወቅ ልዩ ስሙ ነው ። ','The human-readable label for the style.'=>'ቅጡ ከሰው ተነባቢ የሆነ መለያ ። ','Inline CSS code that registers the CSS class required for the style.'=>'ለ ቅጥ ያስፈልጋል የCS ክፍልን የሚመዘግብ የበየነመረብ CSS ኮድ ። ','Contains the handle that defines the block style.'=>'የታገደውን ቅጥ የሚከለክለውን እጀታ ይዟል ። ','Public text domain.'=>'ይፋዊ የጽሁፍ ጎራ ። ','Parent blocks.'=>'የወላጅ እድገት ','Block keywords.'=>'ቁልፍ ቃላትን አግድ ። ','Block example.'=>'ምሳሌ ጥግ ። ','The attributes used in the example.'=>'በምሳሌው ላይ የተጠቀሙት ባሕርያት ። ','The list of inner blocks used in the example.'=>'በዚህ ረገድ ምሳሌ የሚሆኑን ውስጣዊ ሕንጻዎች ዝርዝር ። ','The name of the inner block.'=>'የውስጠኛው ጥግ ስም ። ','The attributes of the inner block.'=>'የውስጠኛው ጥግ ባሕርያት ። ','A list of the inner block\'s own inner blocks. This is a recursive definition following the parent innerBlocks schema.'=>'ውስጠኛው ክፍል የውስጥ ክፍሎች ዝርዝር ። ይህ የወላጅ ውስጠኛ ብናኝ ሴራውን ተከትሎ መልሶ የሚተረጎም ፍቺ ነው ። ','Block namespace.'=>'የስም መለኪያ ','The theme\'s stylesheet. This uniquely identifies the theme.'=>'ጭብጡ የልብስ ሉህ ነው ። ይህም ጭብጡን ለይቶ ያሳያል ። ','The theme\'s template. If this is a child theme, this refers to the parent theme, otherwise this is the same as the theme\'s stylesheet.'=>'የ ጭብጡ ቅንብር ይህ የልጆች ጭብጥ ከሆነ ወላጅ የሚለውን ጭብጥ የሚያመለክት ነው ፤ አለዚያ ግን ይህ ጭብጥ ከጭብጡ ጋር ተመሳሳይ ነው ። ','The theme author.'=>'ጭብጡ ደራሲ ። ','The theme author\'s name, as found in the theme header.'=>'ጭብጡ ርዕስ ላይ የሚገኘው የደራሲው ስም ነው ። ','HTML for the theme author, transformed for display.'=>'ለግጥም ደራሲ HTML ፣ ለዕይታ ተለውጧል ። ','The website of the theme author.'=>'የደራሲው ጭብጥ ድረ ገጽ ። ','The website of the theme author, as found in the theme header.'=>'የደራሲው ጭብጥ ርእስ ላይ እንደተገኘው ድረ ገጽ ነው ። ','The website of the theme author, transformed for display.'=>'ለታይታ የተለወጠው የደራሲው ጭብጥ ድረ ገጽ ነው ። ','A description of the theme.'=>'ስለ ጭብጡ መግለጫ ። ','The theme description, as found in the theme header.'=>'ጭብጡ መግለጫ ፣ በመልዕክቱ ርዕስ ላይ እንደተገኘው ። ','The theme description, transformed for display.'=>'ጭብጡ መግለጫውን ለማሳየት ይለወጣል ። ','The name of the theme.'=>'የንግግሩ ስም ። ','The theme name, as found in the theme header.'=>'ጭብጡ የተመሠረተበት ስም በዋናው ርዕስ ላይ እንደሚገኘው ። ','The theme name, transformed for display.'=>'የሚለውን ጭብጥ ስሙን ለማሳየት መለወጥ ። ','The minimum PHP version required for the theme to work.'=>'ጭብጡ እንዲሰራ የሚፈለገው አነስተኛ የፋይል ስሪት ። ','The theme\'s screenshot URL.'=>'የ ጭብጡ ስክሪንሾት URL ። ','Tags indicating styles and features of the theme.'=>'የገጹን ገጽታ የሚጠቁሙ ቅጦችና ባህሪያት መለያዎች ። ','The theme tags, as found in the theme header.'=>'ጭብጡ መለያ ርእስ ውስጥ እንደተገኘው መለያዎቹ ናቸው ። ','The theme tags, transformed for display.'=>'ጭብጡ መለያዎች ፣ ለታይታ የተለወጡ ናቸው ። ','The theme\'s text domain.'=>'የገጽታ ጽሁፍ ጎራ ። ','The URI of the theme\'s webpage.'=>'ጭብጡ የሚገኝበት ድረ ገጽ ','The URI of the theme\'s webpage, as found in the theme header.'=>'ጭብጡ የተመሠረተበት ሰንጠረዥ ','The URI of the theme\'s webpage, transformed for display.'=>'ለታይታ የምትለወጠው ጭብጥ ያለው የድር ገጽ ','The theme\'s current version.'=>'የ ጭብጡ የአሁኑ ስሪት ነው ። ','WordPress.org plugin directory slug.'=>'Wordpress.org ፐብሊካን ማውጫ ስላይድ ። ','The plugin activation status.'=>'የፕሉጊን የማንቃት ሁኔታ ። ','Sorry, you are not allowed to manage plugins for this site.'=>'ይቅርታ ፣ ለዚህ ጣቢያ ቅጂዎችን ለማስተዳደር አልተፈቀደም ። ','Plugin not found.'=>'ፕሉጊን አልተገኘም ። ','Sorry, you are not allowed to install plugins on this site.'=>'ይቅርታ ፣ በዚህ ጣቢያ ላይ ፕሪግኖችን እንዲጭኑ አልተፈቀደም ። ','Sorry, you are not allowed to activate plugins.'=>'ይቅርታ ፣ የተቀዱ ንጥሎችን ማንቃት አልተፈቀደም ። ','Unable to connect to the filesystem. Please confirm your credentials.'=>'ከፋይሎች ጋር መገናኘት አልተቻለም ። እባክዎ አሳማኝ መታወቂያዎችዎን ያረጋግጡ ። ','Unable to determine what plugin was installed.'=>'ፕሉጊን የተጫነበትን ለማወቅ አልተቻለም ። ','Sorry, you are not allowed to delete plugins for this site.'=>'ይቅርታ ፣ ለዚህ ጣቢያ ቧንቧዎችን ለመሰረዝ አልተፈቀደም ። ','Cannot delete an active plugin. Please deactivate it first.'=>'ንቁ ፕሉጊን መሰረዝ አልተቻለም ። እባክዎ መጀመሪያ ያዙት ። ','Sorry, you are not allowed to deactivate this plugin.'=>'ይቅርታ ፣ ይህን ፕሉጊን ን እንዲሰራ አልተፈቀደም ። ','Network only plugin must be network activated.'=>'የአውታረ መረብ ብቻ ሊነቃ ይገባል ። ','The filesystem is currently unavailable for managing plugins.'=>'ፋይሎችአሁን ለአሰራር አይገኙም ። ','The plugin file.'=>'የፐሉጊን ፋይል ። ','The plugin name.'=>'የፕሉጊን ስም ። ','The plugin\'s website address.'=>'የፕሉጊን የድር ጣቢያ አድራሻ ። ','The plugin author.'=>'የፑሉጊን ደራሲ ','Plugin author\'s website address.'=>'የፕሉጊን ደራሲ የድር ጣቢያ አድራሻ ። ','The plugin description.'=>'ይህ ዓይነቱ መግለጫ ። ','The raw plugin description.'=>'ጥሬውን የፕሉጊን መግለጫ ። ','The plugin description formatted for display.'=>'ለማሳያ የተቀረጸውን የፐሉጊን መግለጫ ። ','The plugin version number.'=>'የፐሉጊን ስሪት ቁጥር ። ','Whether the plugin can only be activated network-wide.'=>'ፕሉጊን የአውታረ መረብ ስፋት ያለው ንቃት ብቻ ይሁን ። ','Minimum required version of PHP.'=>'አነስተኛ የሚፈለገው የፋይል ስሪት ። ','The plugin\'s text domain.'=>'የፕሉጊን የጽሁፍ ጎራ ። ','Limits results to plugins with the given status.'=>'ከተሰጠው አቋም ጋር ለመተካት የወሰን ውጤቶች ። ','This username is invalid because it uses illegal characters. Please enter a valid username.'=>'ይህ የተጠቃሚ ስም ህገ ወጥ ቁምፊዎችን ስለሚጠቀም ተገቢ አይደለም ። እባክዎ ትክክለኛ የተጠቃሚ ስም ያስገቡ ። ','Sorry, you are not allowed to browse the block directory.'=>'ይቅርታ ፣ የመግቢያው ማውጫ እንድታስስስ አልተፈቀደልህም ። ','The block name, in namespace/block-name format.'=>'የታገደ ስም ፣ በስም ምልክት / ጥግ-ስም ቅርጸት ። ','The block title, in human readable format.'=>'የታገደ አርእስት ፣ በሰው ተነባቢ ቅርጸት ውስጥ ። ','A short description of the block, in human readable format.'=>'ስለ ጥግ አጭር መግለጫ ፣ በሰው ተነባቢ ቅርጸት ። ','The block slug.'=>'ጥግዱ ተንሸራታች ። ','The star rating of the block.'=>'የታገዱ የኮከብ ደረጃ ። ','The number of ratings.'=>'የአይጦች ቁጥር ። ','The number sites that have activated this block.'=>'ይህን ጥግ ያነቃቁ ቁጥር ጣቢያዎች ። ','The average rating of blocks published by the same author.'=>'በተመሳሳይ ደራሲ የታተሙ ማእድናት አማካይ ደረጃ ። ','The number of blocks published by the same author.'=>'በአንድ ደራሲ የታተሙ ማከፋፈያዎች ቁጥር ። ','The date when the block was last updated, in fuzzy human readable format.'=>'ጥግው በመጨረሻ የዘመነበት ቀን ፣ እንቆቅልሽ የሆነው የሰው ልጅ በቀላሉ ሊነበብ በሚችል መልክ ነው ። ','Limit result set to blocks matching the search term.'=>'የፍለጋ ቁጥር ለማዛመድ የገደብ ውጤት ተዘጋጅቷል ። ','Unable to get meta information for file.'=>'ለፋይል የ ሜታ መረጃ ማግኘት አልተቻለም ። ','This type of file cannot be edited.'=>'ይህ አይነት ፋይል አርትዕ ሊደረግ አይችልም ። ','The image was not edited. Edit the image before applying the changes.'=>'ምስሉ አርትዕ አልተደረገም ። ለውጦቹን ከመተግበርህ በፊት ምስሉን አርትዕ ። ','Unable to edit this image.'=>'ይህንን ምስል አርትዕ ማድረግ አልተቻለም ። ','Unable to rotate this image.'=>'ይህን ምስል ማዞር አልተቻለም ። ','Unable to crop this image.'=>'ይህን ምስል መከርከም አልተቻለም ። ','URL to the edited image file.'=>'Url ወደ አርትዖት ምስሉ ፋይል ። ','The file URL has been copied to your clipboard'=>'የፋይሉ URL ወደ ቅንጥብ ሰሌዳዎ ተቀድቷል ','Sorry, you are not allowed to manage network plugins.'=>'ይቅርታ ፣ የአውታረ መረብ ዝርጋቶችን ለማስተዳደር አልተፈቀደም ። ','You need to pass an array of post formats.'=>'የተለያዩ የፖስታ ቅርጸቶችን ማለፍ አለብዎ ። ','Version of block API.'=>'የapi ስሪት ። ','Directory sizes could not be returned.'=>'ማውጫውን ማስመለስ አልተቻለም ። ','The name of the test being run.'=>'የፈተናው ስም እየሮጠ ነው ። ','The category this test is grouped in.'=>'ይህ ፈተና ምድብ በ ተቧድኗል ። ','A more descriptive explanation of what the test looks for, and why it is important for the user.'=>'ፈተናው ምን እንደሚመስል የበለጠ ገላጭ ማብራሪያ ፣ እና ለምን ለተጠቃሚው አስፈላጊ ነው? ','HTML containing an action to direct the user to where they can resolve the issue.'=>'ኤችቲኤምኤል ችግሩን የት መፍታት እንደሚችሉ ተጠቃሚውን ወደ ማምራት የሚያስችል እርምጃ ይዟል ። ','Application passwords are not available.'=>'የመተግበሪያ የይለፍ ቃላት አይገኙም ። ','Application passwords are not available for your account. Please contact the site administrator for assistance.'=>'የመተግበሪያ የይለፍ ቃሎች ለእርስዎ መለያ አይገኙም ። እባክዎ ለእገዛ የጣቢያውን አስተዳዳሪ ያነጋግሩ ። ','The unique identifier for the application password.'=>'የመተግበሪያው የይለፍ ቃል ልዩ መለያ ነው ። ','A UUID provided by the application to uniquely identify it. It is recommended to use an UUID v5 with the URL or DNS namespace.'=>'ለይቶ ለማወቅ በመተግበሪያ የተሰጠ UUID። Url ወይም DNS ስያሜዎች መለኪያ በመጠቀም UUID V5ን መጠቀም ይመከራል ። ','The name of the application password.'=>'የመተግበሪያው የይለፍ ቃል ስም ። ','The generated password. Only available after adding an application.'=>'የተሰራው የይለፍ ቃል ። መተግበሪያን ካከሉ በኋላ ብቻ ይገኛል ። ','The GMT date the application password was created.'=>'የ GMT ቀን የትግበራ የይለፍ ቃል ተፈጥሯል ። ','The GMT date the application password was last used.'=>'Gmt ቀን የትግበራ የይለፍ ቃል በመጨረሻ ጥቅም ላይ ውሏል ። ','The IP address the application password was last used by.'=>'የመተግበሪያውን የይለፍ ቃል ለመጨረሻ ጊዜ ጥቅም ላይ ውሏል የIP አድራሻ ። ','Enter your new password below or generate one.'=>'አዲስ የይለፍ ቃልዎን ከታች ያስገቡ ወይም አንድ ያመነጩ ። ','Generate Password'=>'የይለፍ ቃል ያመነጫሉ ','Save Password'=>'የይለፍ ቃል አስቀምጥ ','Sorry, you are not allowed to view the active theme.'=>'ይቅርታ ፣ ንቁ ገጽታውን ማየት አልተፈቀደም ። ','Theme not found.'=>'ገጽታ አልተገኘም ። ','A named status for the theme.'=>'ለ ጭብጡ የተሰየመ አቋም ። ','Limit response to posts modified after a given ISO8601 compliant date.'=>'ዝቅተኛ የድምፅ መጠን ቅናሽ የተደረገበት ISO8601 አቤቱታ ከተሰማ በኋላ ነው ። ','Limit response to posts modified before a given ISO8601 compliant date.'=>'ዝቅተኛ የድምፅ መጠን ቅናሽ የተደረገበት የአይ ኤስ.ኤስ.8601 አቤቱታ የሚቀርብበት ቀን ከመድረሱ በፊት ነው ። ','Term ID List'=>'የምስጥ መታወቂያ ዝርዝር ','Match terms with the listed IDs.'=>'ቁጥሮችን ከተዘረዘሩት መታወቂያዎች ጋር አዛምድ ። ','Term ID Taxonomy Query'=>'የቃለ መጠይቅ መታወቂያ የግብር አሰባሰብ መጠይቅ ','Perform an advanced term query.'=>'የላቀ መጠይቅ ያከናውናሉ ። ','Term IDs.'=>'የቃላት መታወቂያዎች ። ','Whether to include child terms in the terms limiting the result set.'=>'የሕፃናት ውሎች በውጤቱ ላይ ገደብ ስለማድረግ ። ','Array of image edits.'=>'የምስል አርትዕ ድርድር ። ','Image edit.'=>'ምስል አርትዕ ። ','Rotation'=>'ሽክርክር ','Rotation type.'=>'ሽክርክር አይነት ። ','Rotation arguments.'=>'ሽክርክርክር ። ','Angle to rotate clockwise in degrees.'=>'ሰዓትህን ቀስ በቀስ ማሽከርከር ዘዌ ። ','Crop type.'=>'የሰብል ዓይነት ። ','Crop arguments.'=>'የሰብል ክርክር ። ','Horizontal position from the left to begin the crop as a percentage of the image width.'=>'መቶኛ የምስሉ ስፋት ሆኖ አዝመራውን ለመጀመር ከግራ በኩል አግድም አቀማመጥ ። ','Vertical position from the top to begin the crop as a percentage of the image height.'=>'አዝመራው ከምስሉ ቁመት መቶኛ ደረጃ እንዲሆን ለመጀመር ከላይ ወደታች አቀባዊ አቀማመጥ ። ','Width of the crop as a percentage of the image width.'=>'የምርቱ ወርድ እንደ መቶኛ የምስል ወርድ ነው ። ','Height of the crop as a percentage of the image height.'=>'የምርቱ ቁመት መቶኛ ምስሉ ቁመት ነው ። ','The amount to rotate the image clockwise in degrees. DEPRECATED: Use `modifiers` instead.'=>'ምስሉ ሰዓቱን በዲግሪ ደረጃ ማሽከርከር ይኖርበታል ። መዘጋጀት ፦ በምትኩ \'በሞባይሎች "መጠቀም ። ','As a percentage of the image, the x position to start the crop from. DEPRECATED: Use `modifiers` instead.'=>'መቶኛ ምስሉ እንደመሆኑ መጠን ምርቱን ከ ለማስጀመር x አቀማመጥ አለው ። መዘጋጀት ፦ በምትኩ \'በሞባይሎች "መጠቀም ። ','As a percentage of the image, the y position to start the crop from. DEPRECATED: Use `modifiers` instead.'=>'መቶኛ ምስሉ እንደመሆኑ መጠን ሰብሉን ከ ለማስጀመር የሚያስችል አቀማመጥ አለው ። መዘጋጀት ፦ በምትኩ \'በሞባይሎች "መጠቀም ። ','As a percentage of the image, the width to crop the image to. DEPRECATED: Use `modifiers` instead.'=>'ምስሉ በመቶኛ ሲሰላ ምስሉን ወደ የመዝራት ወርድ አለው ። መዘጋጀት ፦ በምትኩ \'በሞባይሎች "መጠቀም ። ','As a percentage of the image, the height to crop the image to. DEPRECATED: Use `modifiers` instead.'=>'ምስሉ በመቶኛ ሲሰላ ምስሉን ወደ ለመዝራት ቁመቱ ከፍ ይላል ። መዘጋጀት ፦ በምትኩ \'በሞባይሎች "መጠቀም ። ','Invalid request status.'=>'ልክ ያልሆነ የጥያቄ ሁኔታ ። ','Invalid personal data request.'=>'ልክ ያልኾነ የግል ውሂብ ጥያቄ ። ','This personal data request has expired.'=>'ይህ የግል የውሂብ ጥያቄ ጊዜው አልፎበታል ። ','The confirmation key is missing from this personal data request.'=>'የማረጋገጫ ቁልፍ ከዚህ የግል የውሂብ ጥያቄ ጠፍቷል ። ','The confirmation key is invalid for this personal data request.'=>'ለዚህ የግል የውሂብ ጥያቄ የማረጋገጫ ቁልፍ ልክ አይደለም ። ','The confirmation key has expired for this personal data request.'=>'ለዚህ የግል የውሂብ ጥያቄ የማረጋገጫ ቁልፍ ጊዜው አልፎበታል ። ','Unique identifier for the attachment.'=>'ለአባሪ ልዩ መለያ ። ','The ID for the autosave.'=>'በራስ ሰር የማስቀመጥ መታወቂያ ። ','Block variations.'=>'ልዩነቶችን አግድ ። ','The unique and machine-readable name.'=>'በዓይነቱ ልዩ የሆነና ለማንበብ የማያስችል ስም ነው ። ','A human-readable variation title.'=>'ከሰው ተነጥሎ የሚታይ የተለያየ ስያሜ ። ','A detailed variation description.'=>'ዝርዝር ልውጥ መግለጫ ። ','Indicates whether the current variation is the default one.'=>'የአሁኑ ልውጥ ነባሪ መሆኑን ያመለክታል ። ','The initial values for attributes.'=>'ለባሕርያቱ መሠረት የሚሆነው ነገር ','The list of scopes where the variation is applicable. When not provided, it assumes all available scopes.'=>'ልዩነቱ የሚፈተሽበት የስኮቱ ዝርዝር ጽሑፉ ካልተዘጋጀ ደግሞ ሊገኙ የሚችሉትን ሸንተረሮች በሙሉ ያካትታል ። ','Unique identifier for the comment.'=>'ለአስተያየት የተለየ ማንነት አለው ። ','URL to the comment.'=>'Url ወደ አስተያየት ። ','Type of the comment.'=>'የአስተያየት ዓይነት ። ','Sort collection by comment attribute.'=>'የአስተያየት ሰጪ ባህሪ በመጠቀም ስብስብ ይደርድሩ ። ','Sorry, you are not allowed to browse the local block pattern directory.'=>'ይቅርታ ፣ የአካባቢ ጥግ ማውጫውን ማሰስ አልተፈቀደም ። ','The pattern title, in human readable format.'=>'ይህ የማዕረግ ስም በቀላሉ ሊነበብ በሚችል መንገድ ። ','The pattern content.'=>'የቅጂ ይዘቱ ። ','The pattern\'s category slugs.'=>'የክርክሩ ምድብ ተንሸራታች ። ','A description of the pattern.'=>'ስለ ምሳሌው መግለጫ ። ','The preferred width of the viewport when previewing a pattern, in pixels.'=>'አንድ ንድፍ ፣ ፒክስልስ ውስጥ በምትመለከትበት ጊዜ ተመራጭ የዕይታውን ስፋት ። ','Limit results to those matching a category ID.'=>'ከ ምድብ መታወቂያ ጋር በሚዛመዱ ላይ ውጤቶችን ይገድቡ ። ','Limit results to those matching a keyword ID.'=>'የቁልፍ ቃል መታወቂያ በሚዛመዱ ላይ ውጤቶች ይገድቡ ። ','Unique identifier for the post.'=>'ለፖስታ ቤቱ የተለየ መታወቂያ ። ','URL to the post.'=>'Url ወደ ፖስታ ቤት ። ','Type of post.'=>'የፖስታ ዓይነት ። ','The title for the post.'=>'የፖስታውን ርዕስ ። ','The order of the post in relation to other posts.'=>'ፖስታውን ከሌሎች ፖስታዎች ጋር በማያያዝ ያዘጋጀው ቅደም ተከተል ። ','Sort collection by post attribute.'=>'ስብስብ በድምጽ ባህሪ ደርድር ። ','Whether items must be assigned all or any of the specified terms.'=>'ንጥል ነገሮች ሁሉንም መመደብ አለባቸው ወይስ ከተወሰኑት ውሎች ውስጥ የትኛውንም መያዝ አለባቸው? ','Unique identifier for the revision.'=>'ለትርዒቱ የተለየ ምልክት ነው ። ','The ID for the author of the revision.'=>'የስርአቱ ደራሲ ምልክት ። ','The id of a registered sidebar'=>'የተመዘገበ የጎን አሞሌ ጣዖት ','No sidebar exists with that id.'=>'በዚያ ጣዖት የጎን አሞሌ የለም ። ','Sorry, you are not allowed to manage widgets on this site.'=>'ይቅርታ ፣ በዚህ ጣቢያ ላይ ያሉ ማረጋገጫዎችን ለማስተዳደር አልተፈቀደም ። ','Inactive widgets'=>'የቀዘቀዙ ወፎች ','ID of sidebar.'=>'የጎን አሞሌ መታወቂያ ። ','Unique name identifying the sidebar.'=>'የጎን አሞሌውን ለመለየት ልዩ ስም አለው ። ','Description of sidebar.'=>'የጎን አሞሌ መግለጫ ','Extra CSS class to assign to the sidebar in the Widgets interface.'=>'ተጨማሪ CSS ክፍል የጎን አሞሌው በWebutlook መሃል እንዲመደብ ። ','HTML content to prepend to each widget\'s HTML output when assigned to this sidebar. Default is an opening list item element.'=>'ወደ እዚህ የጎን አሞሌ ሲመደብ ለእያንዳንዱ ወርድ HTML ውጣውረድ ለማዘጋጀት HTML ይዘት አለው ። ነባሪ የመክፈቻ ዝርዝር ንጥል አባል ነው ። ','HTML content to append to each widget\'s HTML output when assigned to this sidebar. Default is a closing list item element.'=>'ወደ እዚህ የጎን አሞሌ ሲመደብ ለእያንዳንዱ ወርድ HTML ውጣውረድ HTML ውጣውረድ ለመጫን HTML ይዘት አለው ። ነባሪ የመዝጊያ ዝርዝር ንጥል አባል ነው ። ','HTML content to prepend to the sidebar title when displayed. Default is an opening h2 element.'=>'ኤችቲኤምኤል ይዘት በሚታይ ጊዜ ወደ የጎን አሞሌ ርእስ ለማዘጋጀት ። ነባሪ የመክፈቻ H2 አባል ነው ። ','HTML content to append to the sidebar title when displayed. Default is a closing h2 element.'=>'ሲታዩ ወደ ጎን አሞሌ ርእስ ለመሾም HTML ይዘት ። ነባሪ የመዝጊያ H2 አባል ነው ። ','Status of sidebar.'=>'የጎን አሞሌ ሁኔታ ። ','Nested widgets.'=>'ቅንብር የሌላቸው ወፎች ። ','The id of a template'=>'የአብነት ጣዖት ','Sorry, you are not allowed to access the templates on this site.'=>'ይቅርታ ፣ በዚህ ጣቢያ ላይ ዝግጁ ይዞታዎችን እንዲደርሱ አልተፈቀደም ። ','No templates exist with that id.'=>'ከዚያ ጣዖት ጋር ምንም ቅርጸ ይዘቶች የሉም ። ','Templates based on theme files can\'t be removed.'=>'የገጽታ ፋይሎችን መሰረት ያደረጉ አብነቶች ሊወገዱ አይችሉም ። ','The template has already been deleted.'=>'አብነቱ ቀደም ሲል ተሰርዟል ። ','Limit to the specified post id.'=>'ወደ ተወሰነው ድህረ ጣዖት ገደብ ። ','ID of template.'=>'የአብነት መታወቂያ ። ','Unique slug identifying the template.'=>'ቅርጸ ይዘቱን ለይቶ ማወቅ ልዩ ሸንተረር ነው ። ','Theme identifier for the template.'=>'የገጽታ መለያ ለአብነቱ የተለየ ነው ። ','Source of template'=>'የአብነት ምንጭ ','Content of template.'=>'የአብነት ይዘት ። ','Title of template.'=>'የአብነት ርእስ ። ','Description of template.'=>'የአብነት መግለጫ ። ','Status of template.'=>'የአብነት ሁኔታ ። ','Post ID.'=>'መታወቂያ ፡ ፖስት ','Theme file exists.'=>'የገጽታ ፋይል አለ ። ','Sort collection by user attribute.'=>'ስብስብ በተጠቃሚ ባህሪ ደርድር ። ','The widget type id.'=>'የማስፋት አይነት ። ','Current instance settings of the widget.'=>'የስፋቱ የአሁኑ አብነት ቅንጅቶች ። ','Serialized widget form data to encode into instance settings.'=>'ወደ አብነት ቅንብሮች ለማመሳጠር ሰርጋዊ የቅጽ ውሂብ ። ','Invalid widget type.'=>'ልክ ያልኾነ የማስፋት አይነት ። ','Unique slug identifying the widget type.'=>'ልዩ ሸንተረር የስፋቱን አይነት ለይቶ ያመለክታል ። ','Human-readable name identifying the widget type.'=>'የሰፋውን ዓይነት ለመለየት የሚረዳ ሰብዓዊ ስም ። ','Description of the widget.'=>'ስለ መውረጃው መግለጫ ። ','Whether the widget supports multiple instances'=>'መውለድ ብዙ ጊዜ የሚደግፍም ይሁን ','Class name'=>'ምድብ ስም ','Cannot preview a widget that does not extend WP_Widget.'=>'Wp _ Widገትን የማያራዝም መውጫ ቅድመ ዕይታ ማድረግ አይቻልም ። ','The provided instance is malformed.'=>'የቀረበው አብነት የተዛባ ነው ። ','Whether to force removal of the widget, or move it to the inactive sidebar.'=>'ወፋቱን የማስወገድ ወይም ወደ ቀዘቀዘ የጎን አሞሌ የማንቀሳቀስ ። ','No widget was found with that id.'=>'በዚህ ጣዖት ውስጥ ምንም መውጫ አልተገኘም ። ','Widget type (id_base) is required.'=>'የማስፋት አይነት (የጣዖት መነሻ) ያስፈልጋል ። ','The provided widget type (id_base) cannot be updated.'=>'የተሰጠው የወርድ አይነት (የOutlook) መሰረት ሊዘመን አይችልም ። ','Cannot set instance on a widget that does not extend WP_Widget.'=>'Wp _ WidGን በማያራዝም መውጫ ላይ አብነት መፍጠር አይቻልም ። ','Widget type does not support raw instances.'=>'የማረፊያ አይነት ጥሬ ጊዜን አይደግፍም ። ','The provided instance is invalid. Must contain raw OR encoded and hash.'=>'የቀረበው አብነት ልክ አይደለም ። ጥሬ OR የተመሰጠረና ሃሺሽ መያዝ አለበት ። ','The requested widget is invalid.'=>'የተጠየቀው መውለድ ልክ አይደለም ። ','The sidebar to return widgets for.'=>'የጎን አሞሌው ለ ማዕዘኖችን ለመመለስ ። ','Unique identifier for the widget.'=>'ለበረቱ ልዩ መለያ ','The type of the widget. Corresponds to ID in widget-types endpoint.'=>'የስፋቱ ዓይነት ። ከ መታወቂያ ጋር ተመሳሳይ ነው ። ','The sidebar the widget belongs to.'=>'የጎን አሞሌው ልፋቱ የ.... ነው ። ','HTML representation of the widget.'=>'ኤችቲኤምኤል ለጠገብ ውክልና ። ','HTML representation of the widget admin form.'=>'Html ውክልናው የስፋቱ አስተዳዳሪ ቅጽ ። ','Instance settings of the widget, if supported.'=>'ከተደገፉ ፣ የማስፋቱ አብነት ቅንጅቶች ። ','Base64 encoded representation of the instance settings.'=>'መሰረት64 የ አብነት ቅንጅቶች የተከተተ ውክልና ። ','Cryptographic hash of the instance settings.'=>'ክሪፕቶግራፊያዊ አቀማመጥ አብነት ስላለው ቅንጅቶች ያለው ሃሽ ። ','Unencoded instance settings, if supported.'=>'ያልተነደፉ የ አብነት ቅንጅቶች ፣ ከተደገፉ ። ','URL-encoded form data from the widget admin form. Used to update a widget that does not support instance. Write only.'=>'ከ ስፋት አስተዳዳሪ ቅጽ የURL-የተመሰጠረ የቅጽ ውሂብ ። ለአብነት የማይደግፍ የማእረግ ማውጫ ለማዘመን ጥቅም ላይ ውሏል ። ብቻ ጻፍ ። ','This image cannot be processed by the web server. Convert it to JPEG or PNG before uploading.'=>'ይህ ምስል በድር አገልጋዩ ሊኬድ አይችልም ። ከመስቀልህ በፊት ወደ JPEG ወይም PNG ቀይረው ። ','<strong>Error</strong>: Unknown email address. Check again or try your username.'=>'<strong>ስሕተት</strong>: - የማይታወቅ የኢሜይል አድራሻ ። እንደገና ይፈትሹ ወይም የተጠቃሚ ስምዎን ይሞክሩ ። ','<strong>Error</strong>: Unknown username. Check again or try your email address.'=>'<strong>ስሕተት</strong> ፦ የማይታወቅ የተጠቃሚ ስም ። እንደገና ይፈትሹ ወይም የኢሜይል አድራሻዎን ይሞክሩ ። ','%1$s or %2$s'=>'%1$s ወይም %2$s ','A widget containing a block.'=>'ጥግ የያዘ ወርድ ። ','Block HTML:'=>'ጥግ HTML: ','<strong>Error</strong>: Your password reset link appears to be invalid. Please request a new link below.'=>'<strong>ስሕተት</strong>: የይለፍ ቃልህን ዳግም ማስጀመር አገናኝህ ልክ ያልሆነ ይመስላል ። እባክዎ ከታች አዲስ አገናኝ ይጠየቁ ። ','<strong>Error</strong>: Your password reset link has expired. Please request a new link below.'=>'<strong>ስሕተት</strong> ፦ የይለፍ ቃልህን ዳግም የማስጀመር አገናኝህ ጊዜው አብቅቷል ። እባክዎ ከታች አዲስ አገናኝ ይጠየቁ ። ','<strong>Error</strong>: The passwords do not match.'=>'<strong>ስሕተት</strong> ፦ የይለፍ ቃሎቹ አይዛመዱም ። ','<strong>Error</strong>: User registration is currently not allowed.'=>'<strong>ስሕተት</strong>: የተጠቃሚ ምዝገባ በአሁኑ ጊዜ አይፈቀድም ። ','Layout'=>'አቀማመጥ ','Type / to choose a block'=>'ጥግ ለመምረጥ ተይብ / ','The ID for the parent of the autosave.'=>'በራስ ሰር የማስቀመጥ ወላጅ መታወቂያ ። ','The content for the comment.'=>'የአስተያየት ይዘቱ ። ','Content for the comment, as it exists in the database.'=>'ለአስተያየት ይዘት ፣ በውሂብ ጎታው ውስጥ እንዳለ ። ','HTML content for the comment, transformed for display.'=>'Html ይዘት ለአስተያየቱ ፣ ለታይታ ተለውጧል ። ','The date the comment was published, in the site\'s timezone.'=>'አስተያየቱ የታተመበት ቀን ፣ በጣቢያው የጊዜ ሰሌዳ ውስጥ ። ','The ID for the parent of the comment.'=>'ለአስተያየት ወላጅ መታወቂያ ። ','The date the post was published, in the site\'s timezone.'=>'ፖስት የተደረገበት ቀን ፣ በጣቢያው የጊዜ ሰሌዳ ላይ ። ','The date the post was last modified, in the site\'s timezone.'=>'ድህረ ገጹ መጨረሻ የተሻሻለበት ቀን ፣ በጣቢያው የጊዜ ገደብ ውስጥ ። ','The date the post was last modified, as GMT.'=>'ድህረ ገጹ መጨረሻ የተሻሻለበት ቀን እንደ GMT ። ','An alphanumeric identifier for the post unique to its type.'=>'የፊደል ተራ ቁጥር ምልክት የተለየ ነው ። ','The date the comment was published, as GMT.'=>'አስተያየቱ የታተመበት ቀን እንደ GMT ። ','Keyword'=>'ቁልፍ ቃል ','The date when the block was last updated.'=>'ጥግው በመጨረሻ የዘመነበት ቀን ። ','Public facing and editor script handle.'=>'የአዘጋጁ ፊት ለፊት እና የጽሑፍ አርታዒ እትም ። ','Public facing and editor style handle.'=>'የአዘጋጁ ፊትና የአዘጋጁ ቅጥ እጀታ ። ','Sorry, you are not allowed to export templates and template parts.'=>'ይቅርታ ፣ ዝግጁ ይዞታዎችን እና አብነት ክፍሎችን ወደ ውጭ ለመላክ አልተፈቀደም ። ','The theme identifier'=>'ጭብጡ ለየት ይላል ','Sorry, you are not allowed to edit this global style.'=>'ይቅርታ ፣ ይህን ዓለም አቀፍ ቅጥ አርትዕ ለማድረግ አልተፈቀደም ። ','Sorry, you are not allowed to view this global style.'=>'ይቅርታ ፣ ይህን ዓለም አቀፋዊ ቅጥ እንድታይ አልተፈቀደልህም ። ','No global styles config exist with that id.'=>'ከዚህ ጣዖት ጋር ዓለም አቀፋዊ ግጭት የለም ። ','ID of global styles config.'=>'ዓለም አቀፍ ቅጥ አምባር ። ','Global styles.'=>'ዓለም አቀፋዊ ስልቶች ። ','Global settings.'=>'ዓለም አቀፋዊ የክንውን አውዶች ። ','Title of the global styles variation.'=>'ዓለም አቀፋዊው የአጻጻፍ ስልት ስያሜ ። ','Title for the global styles variation, as it exists in the database.'=>'ርእስ በ ውሂብ ጎታው ውስጥ እንዳለ ፣ ለአለም አቀፍ ቅጦች ልውጥ ','Sorry, you are not allowed to access the global styles on this site.'=>'ይቅርታ ፣ በዚህ ጣቢያ ላይ ያለውን ዓለም አቀፋዊ ቅጦች እንድትደርስ አልተፈቀደም ። ','The title is required when using a custom menu item type.'=>'ብጁ ምናሌ የንጥል አይነት በመጠቀም ጊዜ አርእስት ያስፈልጋል ። ','The url is required when using a custom menu item type.'=>'ብጁ የምናሌ ንጥል አይነት ሲጠቀም ዩአርኤል ይፈለጋል ። ','Get linked object.'=>'የተገናኘ ነገር ያግኙ ። ','Title for the object, as it exists in the database.'=>'የነገሩ ርእስ ፣ በ ውሂብ ጎታው ውስጥ እንዳለ ። ','Name of type.'=>'የ አይነት ስም ። ','A named status for the object.'=>'የነገሩ ስም የተሰጠው ሁኔታ ። ','The ID for the parent of the object.'=>'የነገሩ ወላጅ መታወቂያ ። ','Text for the title attribute of the link element for this menu item.'=>'ለዚህ ምናሌ ንጥል የአገናኝ ንጥረ ነገር የርዕስ ባህርይ ያለው ጽሑፍ ። ','Class names for the link element of this menu item.'=>'የዚህ ምናሌ ንጥል አገናኝ አባል የክፍል ስሞች ። ','The description of this menu item.'=>'የዚህ ምናሌ ንጥል መግለጫ ። ','The DB ID of the nav_menu_item that is this item\'s menu parent, if any, otherwise 0.'=>'ይህ ንጥል ነገር ምናሌ ወላጅ የሆነው ዲቢ አይ ዲ ፣ ሌላ 0 ንጥል ነገር ። ','The database ID of the original object this menu item represents, for example the ID for posts or the term_id for categories.'=>'ይህ የምናሌ ንጥል ነገር የዋናው ነገር የውሂብ ጎታ መታወቂያ ፣ ለምሳሌ ለፖስታዎች መታወቂያ ወይም ለፈርጆች መታወቂያ የሚለውን ቃል ይወክላል ። ','The target attribute of the link element for this menu item.'=>'ለዚህ ምናሌ ንጥል የአገናኝ አባል የታለመ ባህርይ ። ','The singular label used to describe this type of menu item.'=>'የዚህ ዓይነቱን ምናሌ ለመግለጽ ያገለገለው ነጠላ መለያ ። ','The URL to which this menu item points.'=>'ይህ የምናሌ ንጥል ነገር የሚያመለክተው URL። ','The XFN relationship expressed in the link of this menu item.'=>'የ XFN ግንኙነት በዚህ ምናሌ አገናኝ ውስጥ ተገልጿል ። ','Whether the menu item represents an object that no longer exists.'=>'ምናሌው ንጥል ከዚህ በኋላ የማይኖር ነገር ይወክል አይወክልም ። ','An alphanumeric identifier for the menu location.'=>'ለመስመር አካባቢ በፊደል ተራ ቁጥር ምልክት የተለየ ነው ። ','Sorry, you are not allowed to view menu locations.'=>'ይቅርታ ፣ የምናሌ አካባቢዎችን ማየት አልተፈቀደም ። ','Invalid menu location.'=>'ልክ ያልኾነ ምናሌ አካባቢ ። ','The name of the menu location.'=>'የምናሌ አካባቢ ስም ። ','The description of the menu location.'=>'የምናሌ አካባቢ መግለጫ ። ','The ID of the assigned menu.'=>'የተመደቡት ምናሌ መታወቂያ ። ','Sorry, you are not allowed to view menus.'=>'ይቅርታ ፣ ምናሌ ማየት አልተፈቀደም ። ','The menu cannot be deleted.'=>'ምናሉ ሊሰረዝ አይችልም ። ','The locations assigned to the menu.'=>'ለዝርዝሩ የተመደቡ ቦታዎች ። ','Whether to automatically add top level pages to this menu.'=>'ወደ እዚህ ምናሌ በራሰ ሰር የራስጌ ደረጃ ገጾችን ማከል አለመቻል ። ','REST route\'s namespace for the post type.'=>'የድህረ ገጽ አይነት የስም ምልክት ','The visibility settings for the post type.'=>'ለ ድህረ ገጽ አይነት የእይታ ቅንጅቶች ። ','Whether to generate a default UI for managing this post type.'=>'ይህን ድህረ ገፅ አይነት ለማስተዳደር ነባሪ UI ማመንጨት ወይም ማመንጨት ። ','REST namespace route for the taxonomy.'=>'የግብር አከፋፈሉ የስም መለኪያ ይደግም ። ','Limit to the specified template part area.'=>'ወደ ተመለከተው የአብነቱ ክፍል አካባቢ ወሰን ። ','Post type to get the templates for.'=>'ዝግጁ ይዞታዎቹን ለማግኘት ይተይቡ ። ','Type of template.'=>'የ ዝግጁ ይዞታ አይነት ። ','Source of a customized template'=>'የተበጁ ቅርጸ ይዘት ምንጭ ','Content for the template, as it exists in the database.'=>'ለአብነቱ ይዘት ፣ በውሂብ ጎታው ውስጥ እንዳለ ። ','Version of the content block format used by the template.'=>'አብነቱ የተጠቀመበትን የይዘት ገደብ ቅርጸት ስሪት ። ','Title for the template, as it exists in the database.'=>'ለአብነቱ ርእስ ፣ በ ውሂብ ጎታው ውስጥ እንዳለ ። ','HTML title for the template, transformed for display.'=>'ለማሳየት የተሸጋገረው HTML አርእስት ። ','The ID for the author of the template.'=>'ለአብነቱ ደራሲ ያለው መታወቂያ ። ','Whether a template is a custom template.'=>'ዝግጁ ይዞታ ብጁ ቅርጸ ይዘት ይሁን ። ','Where the template part is intended for use (header, footer, etc.)'=>'አብነቱ የተወሰነ ክፍል ጥቅም ላይ ሊውል ከታሰበበት ','The URL to process.'=>'ወደ ሂደት ','The Open Graph image link of the %1$s or %2$s element from the URL.'=>'የ Open Graph ምስል አገናኝ %1$s ወይም %2$s ከ URL ። ','Invalid URL'=>'ልክ ያልኾነ URL ','URL not found. Response returned a non-200 status code for this URL.'=>'Url አልተገኘም ። ለዚህ URL ምላሽ 200 ያልሆነ የአቋም ኮድ መልሷል ። ','Unable to retrieve body from response at this URL.'=>'በዚህ URL ከምላሽ አካል ማግኘት አልተቻለም ። ','Sorry, you are not allowed to filter users by capability.'=>'ይቅርታ ፣ በተቻለው አቅም ተጠቃሚዎችን እንዲያጣሩ አልተፈቀደም ። ','Limit result set to users who have published posts.'=>'ለኅትመት ያበቁ ተጠቃሚዎች ገደብ አበጀ ። ','The server cannot process the image. This can happen if the server is busy or does not have enough resources to complete the task. Uploading a smaller image may help. Suggested maximum size is 2560 pixels.'=>'አገልጋዩ ምስሉን ማስኬድ አይችልም ። አገልጋዩ ስራ ላይ ከሆነ ወይም ተግባሩን ለማጠናቀቅ በቂ ሀብት ከሌለው ይህ ሊከሰት ይችላል ። አነስ ያለ ምስል መስቀል ሊረዳ ይችላል ። የተጠቆመው ከፍተኛ መጠን 2560 ፒክስል ነው ። ','Template Part Areas'=>'የአብነቱ ክፍል ኣርአዎች ','Template Part Area'=>'ዝግጁ ይዞታ ክፍል አካባቢ ','Could not retrieve table charset.'=>'የሰንጠረዥ ሰረገላ ማምጣት አልተቻለም ። ','Could not strip invalid text.'=>'ልክ ያልኾነ ጽሁፍ ማስወገድ አልተቻለም ። ','Confirm'=>'አረጋግጥ ','%1$s is your new site. <a href="%2$s">Log in</a> as &#8220;%3$s&#8221; using your existing password.'=>'%1$s አዲሱ የርስዎ ጣቢያ ነው።<a href="%2$s">ይግቡ</a> እንደ  &#8220;%3$s&#8221; ሆነው ያለዎትን ማለፊያቃል በመጠቀም።','block titleEmbed'=>'ክተት','post formatFormats'=>'ቅርጸቶች','The current image has no alternative text. The file name is: %s'=>'አሁን ያለው ምስል አማራጭ ጽሑፍ የለውም። የፋይሉ ስም፡ %s ነው።','Additional images added to this gallery: %s'=>'ተጨማሪ ምስሎች ወደዚህ ማዕከለ-ስዕላት ታክለዋል፡ %s','The "%1$s" taxonomy "%2$s" property (%3$s) conflicts with an existing property on the REST API Posts Controller. Specify a custom "rest_base" when registering the taxonomy to avoid this error.'=>'የ"%1$s" ታክሶኖሚ "%2$s" ንብረት (%3$s) በREST API Posts Controller ላይ ካለ ንብረት ጋር ይጋጫል። ይህንን ስህተት ለማስቀረት ታክሶኖሚውን ሲመዘግቡ ብጁ "rest_base" ይጥቀሱ።','Filter %s returned items with reserved names.'=>'%s የተመለሱ ንጥሎችን በተያዙ ስሞች አጣራ።','Check your email for the confirmation link, then visit the <a href="%s">login page</a>.'=>'የማረጋገጫ አገናኙን ለማግኘት ኢሜልዎን ያረጋግጡ፣ ከዚያ <a href="%s">የመግቢያ ገጹን</a>ን ይጎብኙ።','Registration complete. Please check your email, then visit the <a href="%s">login page</a>.'=>'ምዝገባው ተጠናቋል። እባክህ ኢሜልህን አረጋግጥ፣ በመቀጠል <a href="%s">የመግቢያ ገጹን</a> ጎብኝ።','Fields other than %s are not currently supported for the sitemap index.'=>'ከ%s ውጪ ያሉ መስኮች በአሁኑ ጊዜ ለጣቢያ ካርታ መረጃ ጠቋሚ አይደገፉም።','[%1$s] Confirm Action: %2$s'=>'[%1$s] አስተማማኝ እርምጃ ፥ %2$s','[%s] Erasure Request Fulfilled'=>'[%s] ጥፋት ያስፈልጋል','Could not update the meta value of %s in database.'=>'በውሂብ ጎታ ውስጥ የ %s የ ሜታ እሴት ማዘመን አልቻለም ።','Fields other than %s are not currently supported for sitemaps.'=>'ከ%s ውጪ ያሉ መስኮች አሁን ለመቀመጫዎች አይደገፉም ።','Could not generate XML sitemap due to missing %s extension'=>'በ%s ቅጥያ ምክንያት የXML ቁጭትን መፍጠር አልተቻለም','Number of URLs in this XML Sitemap: %s.'=>'በዚህ የ XML Sitemap ውስጥ የURLs ቁጥር ፥ %s ።','Please use %s to add new schema properties.'=>'እባክዎ አዲስ የሴራ ባህሪዎችን ለማከል %s ይጠቀሙ ።','This password reset request originated from the IP address %s.'=>'ይህ የይለፍ ቃል ዳግም የማስጀመር ጥያቄ የመነጨው ከIP አድራሻ %s ነው ።','Limit result set to items with specific terms assigned in the %s taxonomy.'=>'በ%s ታክስ አኃዝ ውስጥ ከተመደቡ የተወሰኑ ቁጥሮች ጋር ንጥል ነገሮች ላይ የ ይጫኑ ።','Gallery'=>'ማእከል','Audio'=>'ድምጽ','Calendar'=>'ቀን መቁጠሪያ','Custom HTML'=>'ብጁ HTML','Video'=>'ቪዲዮ','Tag Cloud'=>'መለያ አድርግ','Text'=>'ጽሑፍ','Theme'=>'ገጽታ','The pattern ID.'=>'አይ ዲ ።','<strong>Error</strong>: The username <strong>%s</strong> is not registered on this site. If you are unsure of your username, try your email address instead.'=>'<strong>ስሕተት</strong> ፦ የተጠቃሚ ስም <strong>%s</strong> በዚህ ጣቢያ ላይ አልተመዘገበም ። የተጠቃሚ ስምዎን እርግጠኛ ካልሆኑ ፣ በምትኩ የኢሜይል አድራሻዎን ይሞክሩ ።','Select %s'=>'%s ይምረጡ','A calendar of your site’s posts.'=>'የጣቢያህ ፖስታዎች የቀን መቁጠሪያ','A cloud of your most used tags.'=>'በብዛት ጥቅም ላይ የዋሉ መለያዎችዎ ደመና ።','Previous'=>'ቀዳሚ','Navigation Menu'=>'የዳሰሳ ምናሌ','Menu items do not support trashing. Set \'%s\' to delete.'=>'የምናሌ ንጥሎች ቆሻሻን አይደግፉም ። ለመሰረዝ \'%s\' ን አዘጋጅ ።','The terms assigned to the object in the %s taxonomy.'=>'በ%s የግብር አከፋፈል ውስጥ ለነገሩ የተመደቡት ቁጥሮች ።','Menus do not support trashing. Set \'%s\' to delete.'=>'ማኑስ ቆሻሻን አይደግፍም ። ለመሰረዝ \'%s\' ን አዘጋጅ ።','The contents of the %s element from the URL.'=>'ከurl የ%s አባል ይዘቶች ።','The favicon image link of the %s element from the URL.'=>'የ%s አላባ ከURL የላከው የምስስል አገናኝ ።','The content of the %s element from the URL.'=>'የ%s ንጥረ ነገር ከURL ።','Navigation'=>'ዳሰሳ','The feature "type" is not valid JSON Schema type.'=>'የ"አይነት" ባህሪ ልክ ያልሆነ የJSON Schema አይነት ነው። ','When registering a "variadic" theme feature, the "type" must be an "array".'=>'የ"ተለዋዋጭ" ገጽታ ባህሪን ሲመዘግቡ "አይነት" "ድርድር" መሆን አለበት።','When registering an "array" or "object" feature to show in the REST API, the feature\'s schema must also be defined.'=>'በREST API ለማሳየት የ"ድርድር" ወይም "ነገር" ባህሪን ሲመዘግቡ የባህሪው እቅድም መገለጽ አለበት።','Howdy,

A request has been made to perform the following action on your account:

     ###DESCRIPTION###

