###SITEURL### ','theme<strong>Error:</strong> Current PHP version does not meet minimum requirements for %s.'=>'<strong>ስህተት፡</strong> የአሁኑ የPHP ስሪት ለ%s አነስተኛ መስፈርቶችን አያሟላም።','When registering an "array" feature, the feature\'s schema must include the "items" keyword.'=>'የ"ድርድር" ባህሪን በሚመዘግቡበት ጊዜ የባህሪው እቅድ "ንጥሎች" ቁልፍ ቃሉን ማካተት አለበት።','When registering an "object" feature, the feature\'s schema must include the "properties" keyword.'=>'የ"ነገር" ባህሪን በሚመዘግቡበት ጊዜ የባህሪው እቅድ "ንብረት" የሚለውን ቁልፍ ቃል ማካተት አለበት።','The "%s" must be a callable function.'=>'"%s" ሊጠራ የሚችል ተግባር መሆን አለበት።','The family of objects originally represented, such as "post_type" or "taxonomy".'=>'እንደ "post_type" ወይም "taxonomy" ያሉ የነገሮች ቤተሰብ በመጀመሪያ የተወከሉት።','The type of object originally represented, such as "category", "post", or "attachment".'=>'እንደ "ምድብ"፣ "ፖስት" ወይም "አባሪ" ያሉ በመጀመሪያ የተወከለው ነገር አይነት።','"%1$s" script should not be enqueued together with the new widgets editor (%2$s or %3$s).'=>'"%1$s" ስክሪፕት ከአዲሱ መግብሮች አርታዒ (%2$s ወይም %3$s) ጋር አብሮ መሰለፍ የለበትም።','"%1$s" style should not be enqueued together with the new widgets editor (%2$s or %3$s).'=>'"%1$s" ዘይቤ ከአዲሱ መግብሮች አርታዒ (%2$s ወይም %3$s) ጋር በአንድ ላይ መሰለፍ የለበትም።','REST search handlers must extend the %s class.'=>'REST ፍለጋ አላፊዎች %s ክፍል መዘርጋት አለባቸው ።','[%1$s] Action Confirmed: %2$s'=>'[%1$s] ድርጊት ተረጋገጠ ፥ %2$s','site&larr; Go to %s'=>'&larr; ወደ %s  ሂድ','%d WordPress Update'=>'%d ወርድፕረስ ማዘመኛ','<strong>Error</strong>: Cookies are blocked or not supported by your browser. You must <a href="%s">enable cookies</a> to use WordPress.'=>'<strong>ስህተት</strong>፤ ማሰሻዎ ላይ ኩኪስ አልተደገፈም ወይም ታግዷል። ወርድፕረስ ለመጠቀም <a href="%s">ኩኪን መፍቀድ</a> አለብዎት። ','<strong>Error</strong>: WordPress %1$s requires MySQL %2$s or higher'=>'<strong>ስህተት</strong>፥ ወርድፕረስ %1$s MySQL %2$s ወይም ከፍ ያለ ይፈልጋል።','theme<strong>Error:</strong> Current WordPress and PHP versions do not meet minimum requirements for %s.'=>'<strong>ስህተት፡</strong> አሁን ያሉት የወርድፕረስ እና PHP ስሪቶች ለ%s ዝቅተኛ መስፈርቶችን አያሟሉም።','theme<strong>Error:</strong> Current WordPress version does not meet minimum requirements for %s.'=>'<strong>ስህተት፡</strong> አሁን ያሉት የወርድፕረስ እና PHP ስሪቶች ለ%s ዝቅተኛ መስፈርቶችን አያሟሉም።','User&#8217;s location data used for the Community Events in the WordPress Events and News dashboard widget.'=>'ተጠቃሚ&#8217; በወርድፕረስ ክስተት እና ኒውስ ዳሽሌዳ ወርድ ውስጥ ለማህበረሰብ ክስተቶች ጥቅም ላይ የዋለ የአካባቢ ውሂብ ','Minimum required version of WordPress.'=>'አነስተኛ የተጠየቁት የ ወርድፕረስ ስሪት ። ','WordPress User'=>'ወርድፕረስ ተጠቃሚ','Powered by WordPress'=>'የቀረበው በወርድፕረስ ነው።','The WordPress.org username of the block author.'=>'የታገደውን የደራሲ ስም WordPress.org ። ','WordPress database error %1$s for query %2$s'=>'የወርድፕረስ ውሂብ ጎታ ስህተት %1$s ለ %2$s ጥያቄ','WordPress database error %1$s for query %2$s made by %3$s'=>'የወርድፕረስ ውሂብ ጎታ ስህተት %1$s ለ %2$s ጥያቄ፤ የቀረበው በ %3$s','WordPress database error:'=>'የወርድፕረስ ውሂብ ጎታ ስህተት፥','Whether theme opts in to default WordPress block styles for viewing.'=>'የገጽታ ገጽታ ለማየት ወደ ነባሪ የ ወርድፕረስ ቅጦች ይምረጡ አይመርጥ ። ','This XML Sitemap is generated by WordPress to make your content more visible for search engines.'=>'ይህ የXML Sitemap በ ወርድፕረስ አማካኝነት ነዉ ይዘትዎን ለፍለጋ ሞተሮች የበለጠ የሚታይ ለማድረግ ። ','The minimum WordPress version required for the theme to work.'=>'ጭብጡ እንዲሰራ የሚያስፈልገውን አነስተኛ የ ወርድፕረስ ስሪት ። ','WordPress database error: Processing the value for the following field failed: %s. The supplied value may be too long or contains invalid data.'=>'ወርድፕረስ የውሂብ ጎታ ስህተት ፥ ለሚከተለው መስክ ዋጋውን ማስኬድ አልተሳካም ፥%s ። የቀረበው እሴት በጣም ረጅም ሊሆን ይችላል ወይም ልክ ያልሆነ ውሂብ ይዟል ።','WordPress database error: Processing the values for the following fields failed: %s. The supplied values may be too long or contain invalid data.'=>'ወርድፕረስ የውሂብ ጎታ ስህተት: ለሚከተሉት መስኮች እሴቶችን ማስኬድ አልተሳካም ፥%s ። የቀረቡትን እሴቶች በጣም ረጅም ሊሆኑ ወይም ልክ ያልኾነ ውሂብ ሊያካትቱ ይችላሉ ።','WordPress database error: Could not perform query because it contains invalid data.'=>'ወርድፕረስ የውሂብ ጎታ ስህተት: ጥያቄን መፈጸም አይችልም ምክንያቱም ትክክለኛ ያልሆነ ውሂብ ይዟል ። ','%1$s is not one of %2$s.'=>'%1$s እንደ %2$s አይደለም።','<strong>Error</strong>: Your acco