ea. Press Alt-Shift-H for help.'=>'ሀብታም የጽሑፍ አካባቢ ። ለእገዛ Alt-Shift-H ተጫን።','No route was found matching the URL and request method.'=>'ምንም መንገድ ከURL ጋር የሚዛመድና የጥያቄ ዘዴ አልተገኘም ።','The specified namespace could not be found.'=>'የተጠቀሰው የስም መጠን ሊገኝ አልቻለም ።','The menu name %s conflicts with another menu name. Please try another.'=>'የ ምናሌ ስም %s ከሌላ ምናሌ ስም ጋር ይጋጫል ። እባክዎ ሌላ ይሞክሩ ።','This site has not been activated yet. If you are having problems activating your site, please contact %s.'=>'ይህ ጣቢያ እስካሁን አልተነቃም ። ጣቢያዎን በማነቃቃት ላይ ችግር ካለብዎ ፣ እባክዎ %sን ያነጋግሩ ።','Medium-Large size image width'=>'መካከለኛ-ትልቅ መጠን ምስል ወርድ','Medium-Large size image height'=>'መካከለኛ መጠን ያለው ምስል ቁመት','Term ID is shared between multiple taxonomies'=>'የቃላት መታወቂያ በበርካታ ታክሲዎች መካከል ተጋርቷል','Shift-click to edit this element.'=>'ይህን ንጥረ ነገር አርትዕ ለማድረግ Shift-click።','Display Site Title and Tagline'=>'የሳይት ርእስ እና ንድፍ አሳይ','Paste URL or type to search'=>'ለመፈለግ URL ወይም አይነትን ለጥፍ','Partial render must echo the content or return the content string (or array), but not both.'=>'ከፊል ፍንጭ የይዘቱን ኅብረቁምፊ ማስተጋባት ወይም ወደ ድርድር መመለስ አለበት ፤ ነገር ግን ሁለቱም አይደሉም ።','Unregistering a built-in post type is not allowed'=>'በድህረ-ገጽ አይነት ያልተመዘገበ','Routes must be namespaced with plugin or theme name and version.'=>'መስመሮች በፕሉጊን ወይም በገጽ 7 ላይ በሚገኙት አድራሻዎች ስምና ስሪት የተፈጠሩ መሆን አለባቸው ።','The next group of formatting shortcuts are applied as you type or when you insert them around plain text in the same paragraph. Press Escape or the Undo button to undo.'=>'ቀጣዩ የቅርጸት አቋራጭ ቡድን በምትጽፍበት ጊዜ ወይም በተመሳሳይ አንቀጽ ላይ በንጹህ ጽሁፍ ዙሪያ በምታስገባበት ጊዜ ተግባራዊ ይደረጋል ። አምልጠህ ለመውጣት ወይም የ9ዶ አዝራርን ጠቅ አድርግ ።','Logged in as %s. Edit your profile.'=>'እንደ %s በመለያ ገብቷል ። መገለጫዎን ያርትዑ ።','%s is required to strip image meta.'=>'ይህ %s የምስል ሜታዎችን ለመጣል ያስፈልጋል ።','Image crop area preview. Requires mouse interaction.'=>'የምስል ሰብል አካባቢ ቅድመ ዕይታ ። የመዳፊት መስተጋብር ይፈልጋል ።','Fluid Layout'=>'ፈሳሽ አቀማመጥ','Responsive Layout'=>'ምላሽ የሚሰጥ አቀራረብ','Photoblogging'=>'ፎቶ ግራፍ','Inexistent terms.'=>'የማያረጁ ቃላት ።','Rich Text Area. Press Control-Option-H for help.'=>'ሀብታም የጽሑፍ አካባቢ ። ለእገዛ ቁጥጥር-አማራጭ-H ይጫኑ ።','Warning: the link has been inserted but may have errors. Please test it.'=>'ማስጠንቀቂያ ፥ አገናኙ ቢገባም ስሕተት ሊኖረው ይችላል ። እባክዎ ይፈትኑት ።','PHP\'s XML extension is not available. Please contact your hosting provider to enable PHP\'s XML extension.'=>'የfp XML ቅጥያ አይገኝም ። እባክዎ የFp XML ቅጥያ ለማንቃት አስተናጋጅ አቅራቢዎን ያነጋግሩ ።','Invalid changeset UUID'=>'ልክ ያልኾኑ ለውጦች ዩ አይ ዲ ውስጥ','Non-existent changeset UUID.'=>'የማይገኙ ለውጦች UUIDን ይጠቀሙ ።','This link is not live-previewable.'=>'ይህ አገናኝ የቀጥታ ቅድመ ዕይታ አይደለም ።','This form is not live-previewable.'=>'ይህ ቅጽ የቀጥታ ቅድመ ዕይታ አይደለም ።','Setting does not exist or is unrecognized.'=>'ቅንብር የለም ወይም አይታወቅም ።','Unauthorized to modify setting due to capability.'=>'ብቃቱ የተነሳ ቅንብሩን ለማሻሻል ያልተፈቀደለት ።','Are you sure you want to delete this theme?'=>'ይህን ገጽታ መሰረዝ መፈለግዎን እርግጠኛ ነዎት?','Displaying %d themes'=>'%d ገጽታዎች በማሳየት ላይ','Search themes&hellip;'=>'የፍለጋ ገጽታዎች እና ሲኦልፕ ፤','If you add a video, the image will be used as a fallback while the video loads.'=>'ቪዲዮ ካከሉ ፣ ቪዲዮው በሚጭንበት ጊዜ ምስሉ እንደ ማቋረጥ ያገለግላል ።','Upload your video in %1$s format and minimize its file size for best results. Your theme recommends a width of %2$s pixels.'=>'በ%1$s ቅርጸት ውስጥ ቪዲዮዎን ይጫኑ እና ለበለጠ ውጤቶች የፋይል መጠኑን ይቀንሱ ። የ ገጽታዎ የ%2$s ፒክስሎች ስፋት ይመክራል ።','Upload your video in %1$s format and minimize its file size for best results. Your theme recommends a height of %2$s pixels.'=>'በ%1$s ቅርጸት ውስጥ ቪዲዮዎን ይጫኑ እና ለበለጠ ውጤቶች የፋይል መጠኑን ይቀንሱ ። ጭብጥዎ የ%2$s ፒክስሎች ቁመት ይመክራል ።','Repeat Background Image'=>'የበስተጀርባ ምስል ይደግሙ','Scroll with Page'=>'ከገጽ ጋር ሸብልል','Invalid value for background repeat.'=>'ልክ ያልሆነ እሴት ለበስተጀርባ ድገም ።','Invalid value for background attachment.'=>'ልክ ያልሆነ እሴት ለበስተጀርባ አባሪ ።','Invalid value for background position X.'=>'ልክ ያልሆነ እሴት ለበስተጀርባ አቋም ኤክስ ።','Invalid value for background position Y.'=>'ልክ ያልሆነ እሴት ለበስተጀርባ አቀማመጥ Y ።','Invalid value for background size.'=>'ልክ ያልሆነ እሴት ለበስተጀርባ መጠን ።','Unrecognized background setting.'=>'ያልታወቀ የበስተጀርባ ቅንብር ።','This video file is too large to use as a header video. Try a shorter video or optimize the compression settings and re-upload a file that is less than 8MB. Or, upload your video to YouTube and link it with the option below.'=>'ይህ ቪዲዮ ፋይል እንደ አርእስት ቪድዮ ለመጠቀም በጣም ትልቅ ነው ። አጠር ያለ ቪድዮ ይሞክሩ ወይም የማመሳሰል ቅንብሮችን ያብሩ እና ከ8ሜባ ያነሰ ፋይል እንደገና ይስቀሉ ። ወይም ፣ ቪዲዮዎን ወደ ዩቱብ ይስቀሉ እና ከታች ካለው አማራጭ ጋር ያገናኙት ።','Number of widgets found: %d'=>'የወጥ ቁጥር ተገኝቷል ፥ %d','No widgets found.'=>'ምንም ሚስቶች አልተገኙም ።','Sorry, the term could not be created.'=>'ይቅርታ ፣ ቃሉ ሊፈጠር አልቻለም ።','Markup is not allowed in CSS.'=>'ማርካፕ በCS ውስጥ አይፈቀድም ።','Install and preview theme: %s'=>'ገጽታ ይጫኑ እና ይመልከቱ ፥ %s','New version available. %s'=>'አዲስ ስሪት ይገኛል ። %s','Filter themes'=>'የማጣሪያ ገጽታዎች','Search media items...'=>'የሚዲያ ንጥሎችን ይፈልጉ...','A city in the same timezone as you.'=>'አንቺም በተመሳሳይ ቅጽበት የምትገኝ ከተማ ።','A date format for all date strings.'=>'ለሁሉም የቀን ቅንብር የቀን ቅርጸት ።','A time format for all time strings.'=>'ለሁሉም የጊዜ ቅርጸት ።','A day number of the week that the week should start on.'=>'ሳምንቱ ሊጀምር ከሚገባው የሳምንቱ ቁጥር አንድ ቀን ።','Convert emoticons like :-) and :-P to graphics on display.'=>'እንደ :-) እና :-P ወደ ግራፊክስ ይቀይሩ ።','Default post format.'=>'ነባሪ ድህረ ገጽ ።','Blog pages show at most.'=>'የጦማር ገጾች በአብዛኛዎቹ ላይ ይታያሉ ።','Allow link notifications from other blogs (pingbacks and trackbacks) on new articles.'=>'ከሌሎች ጦማሮች (አጫጭር ፈተናዎች እና የመሮጫ መሰናክሎች) በአዳዲስ ጽሁፎች ላይ የአገናኝ ማሳወቂያዎችን ይፍቀዱ ።','Attachment Attributes'=>'የአባሪ ባህሪያት','Sorry, you must be logged in to comment.'=>'ይቅርታ ፣ አስተያየት ለመስጠት በመለያ መግባት አለብዎ ።','Status is forbidden.'=>'ሁኔታ ክልክል ነው ።','%1$s is not of type %2$s.'=>'%1$s ከ %2$s አይነት አይደለም ።','Comment is required.'=>'አስተያየት መስጠት ያስፈልጋል ።','Invalid JSON body passed.'=>'ልክ ያልኾነ JSON አካል አለፈ ።','Or, enter a YouTube URL:'=>'ወይም ፣ የYouTube URL ያስገቡ ፥','Please enter a valid YouTube URL.'=>'እባክዎ ትክክለኛ የYouTube URL ያስገቡ ።','Header Media'=>'ርእስ ሚዲያ','Sorry, you are not allowed to make posts sticky.'=>'ይቅርታ ፣ ፖስታዎች እንዲጣበቁ አልተፈቀደም ።','Sorry, you are not allowed to delete this comment.'=>'ይቅርታ ፣ ይህን አስተያየት ለመሰረዝ አልተፈቀደም ።','Invalid page template.'=>'ልክ ያልኾነ የገጽ ዝግጁ ይዞታ ።','Invalid JSONP callback function.'=>'ልክ ያልኾነ JSONP የጥሪ ድራይመልስ ተግባር ።','Site tagline.'=>'የጣቢያ መለያ መስመር ።','Default post category.'=>'ነባሪ ድህረ ገጽ ።','Cannot set parent term, taxonomy is not hierarchical.'=>'የወላጅ ቁጥር ማዘጋጀት አይችልም ፣ ታክስ መመርያ አይደለም ።','This address is used for admin purposes, like new user notification.'=>'ይህ አድራሻ ልክ እንደ አዲስ የተጠቃሚ ማሳወቂያ ለአስተዳዳሪ ዓላማ ይውላል ።','You can navigate to other pages on your site while using the Customizer to view and edit the widgets displayed on those pages.'=>'በነዚህ ገጾች ላይ የሚታዩትን ወጠቶች ለማየት እና አርትዕ ለማድረግ ደንበኞችን እየተጠቀሙ ወደ ጣቢያዎ ሌሎች ገጾች መጎብኘት ይችላሉ ።','Id should start with a letter, followed only by letters, numbers, dashes, dots, colons or underscores.'=>'መታወቂያ መጀመር ያለበት በደብዳቤ ሲሆን ደብዳቤ ፣ ቁጥሮች ፣ ሰረዞች ፣ ነጠብጣቦች ፣ ኮልፎች ወይም ሰረዞች ብቻ ነው ።','Table of Contents'=>'የርዕስ ማውጫ','Insert/edit code sample'=>'የኮድ ናሙና አስገባ/አርትዕ','Insert/edit media'=>'ሚዲያ አስገባ/አርትዕ','The URL of the resource for which to fetch oEmbed data.'=>'ኦቨርጅን ውሂብ የሚይዝበት የሃብት URL ።','The oEmbed format to use.'=>'ለመጠቀም የተባዛ ቅርጸት ።','The maximum width of the embed frame in pixels.'=>'የ ክፈፍ ከፍተኛ ወርድ በፒክስልስ ።','The maximum height of the embed frame in pixels.'=>'የ ክፈፉ ከፍተኛ ከፍታ በፒክስልስ ።','Whether to perform an oEmbed discovery request for unsanctioned providers.'=>'የመጸዳጃ ቤት ደንበኞች ኦምቢግ ግኝትን በተመለከተ ጥያቄ ቢያቀርቡም ።','Sorry, you are not allowed to make proxied oEmbed requests.'=>'ይቅርታ ፣ ምትክ የሆኑ የውክልና ጥያቄዎች ማቅረብ አይፈቀድልዎትም ።','Sorry, comments are not allowed for this item.'=>'ይቅርታ ፣ ለዚህ ንጥል አስተያየቶች አልተፈቀደም ።','%1$s is deprecated. The callback from %2$s is used instead.'=>'%1$s ከደረጃ ዝቅ ብሏል ። ከ %2$s የጥሪ መልስ በምትኩ ጥቅም ላይ ውሏል ።','%1$s must be less than or equal to %2$d'=>'%1$s ከ %2$d ያነሰ ወይም እኩል መሆን አለበት','Edit Image'=>'ምስል አርትዕ','Edit Media'=>'ሚዲያ አርትዕ','The previous set of changes has already been published. Please try saving your current set of changes again.'=>'የቀደሙት ለውጦች ስብስብ ቀደም ብሎ ታትሟል ። እባክዎ አሁን ያሉ ለውጦችን ስብስብዎን እንደገና ለማስቀመጥ ይሞክሩ ።','You must supply a future date to schedule.'=>'የወደፊት ቀን በፕሮግራምህ መሠረት ማቅረብ አለብህ ።','There was an authentication problem. Please reload and try again.'=>'የማረጋገጫ ችግር ነበር ። እባክዎ እንደገና ይጫኑ እና እንደገና ይሞክሩ ።','No changes saved yet, so there is nothing to trash.'=>'እስካሁን የተቀመጡ ለውጦች የሉም ፤ ስለዚህ ቆሻሻ መጣያ ምንም ነገር የለም ።','Unable to trash changes.'=>'ለውጦችን ለመጣል አልተቻለም ።','Changes have already been trashed.'=>'ለውጦችም ተጥሰዋል ።','Changes trashed successfully.'=>'ለውጦቹ በተሳካ ሁኔታ እልባት አግኝተዋል ።','Share Preview Link'=>'የቅድመ እይታ አገናኝ አጋራ','See how changes would look live on your website, and share the preview with people who can\'t access the Customizer.'=>'ለውጦች በድር ጣቢያዎ ላይ እንዴት እንደሚኖሩ ይመልከቱ ፣ እና ደንበኛው ዘንድ መድረስ ለማይችሉ ሰዎች ቅድመ ዕይታውን ያጋሩ ።','You can choose what&#8217;s displayed on the homepage of your site. It can be posts in reverse chronological order (classic blog), or a fixed/static page. To set a static homepage, you first need to create two Pages. One will become the homepage, and the other will be where your posts are displayed.'=>'በጣቢያዎ መነሻ ገጽ ላይ የሚታዩትን&#8217; መምረጥ ይችላሉ ። በተገለበጠ የጊዜ ቅደም ተከተል (ንቡር ጦማር) ወይም ቋሚ / ስተታዊ ገጽ ፖስታዎች ሊሆኑ ይችላሉ ። የማይንቀሳቀስ የቤት ገጽ ለማዘጋጀት በመጀመሪያ ሁለት ገጾችን መፍጠር ያስፈልግዎታል ። ከፊልዋ ከከፊሉ የኾነች ዝርያ አድርጎ (መረጣት) ፡ ፡ ሌላይቱም ከከፊሉ ያማረች ኾና ናት ፡ ፡','Your homepage displays'=>'የእርስዎ መነሻ ገጽ ማሳያዎች','Add your own CSS code here to customize the appearance and layout of your site.'=>'የጣቢያዎን መልክ እና አቀማመጥ ለማበጀት የራስዎ የCS ኮድ እዚህ ያክሉ ።','When using a keyboard to navigate:'=>'ለማሰስ የቁልፍ ሰሌዳ ሲጠቀሙ ፥','In the editing area, the Tab key enters a tab character.'=>'በአርትዖት አካባቢ ፣ ትር ቁልፍ ወደ አንድ የቁምፊ ገጸ ባሕርይ ይገባል ።','To move away from this area, press the Esc key followed by the Tab key.'=>'ከዚህ አካባቢ ለማምለጥ የትር ቁልፉን ይጫኑ ።','Screen reader users: when in forms mode, you may need to press the Esc key twice.'=>'የማያ አንባቢዎች ፥ በቅጾች ሁኔታ ውስጥ በሚሆንበት ጊዜ ፣ Esc ቁልፉን ሁለት ጊዜ መጫን ያስፈልግዎ ይሆናል ።','Your theme can display menus in one location.'=>'ጭብጥዎ ምናሌዎችን በአንድ አካባቢ ማሳየት ይችላል ።','If your theme has multiple menus, giving them clear names will help you manage them.'=>'ጭብጡ ብዙ ሰዎች ካሏቸው ግልጽ የሆኑ ስሞችን መስጠት ሁኔታውን ለማሸነፍ ይረዳሃል ።','Create New Menu'=>'አዲስ ምናሌ ፍጠር','The theme defines itself as its parent theme. Please check the %s header.'=>'ጭብጡ ራሱ የወላጆች ጭብጥ እንደሆነ ይገልጻል ። እባክዎ %s ርእስ ይፈትሹ ።','Usage of user levels is deprecated. Use capabilities instead.'=>'የተጠቃሚ ደረጃዎች አጠቃቀም ዝቅተኛ ነው ። በምትኩ ችሎታዎችን ተጠቀም ።','Click &#8220;Add new image&#8221; to upload an image file from your computer. Your theme works best with an image that matches the size of your video &#8212; you&#8217;ll be able to crop your image once you upload it for a perfect fit.'=>'አዲስ ምስል&#8221; ጠቅ&#8220; ምስል ከኮምፒውተርህ ለመስቀል ጠቅ አድርግ ። ገጽታዎ ከቪዲዮዎ&#8212; እርስዎ&#8217; ለዛ ፍፁም በሆነ መልኩ ከሰቀሉት በኋላ ምስልዎን ማሰተካከል ይችላሉ ።','Click &#8220;Add new image&#8221; to upload an image file from your computer. Your theme works best with an image with a header height of %s pixels &#8212; you&#8217;ll be able to crop your image once you upload it for a perfect fit.'=>'አዲስ ምስል &#8220; አክል&#8220;፤ ምስል ከኮምፒውተርህ ለመስቀል ጠቅ አድርግ ። ገጽታዎ %s ፒክስል &#8212; እርስዎ&#8217;ከሰቀሉት በኋላ ምስልዎን ማሰተካከል ይችላሉ ።','Install &amp; Preview'=>'ጫን እና አምፕ ፤ ቅድመ እይታ','Search WordPress.org themes'=>'WordPress.org ገጽ ገጽታዎች ፈልግ','Go to theme sources'=>'ወደ ገጽታ ምንጮች ይሂዱ','Filter themes (%s)'=>'የማጣሪያ ገጽታዎች (%s)','The Press This plugin is required.'=>'የዚህን ፕሉጊን ፕሬስ መጠቀም ያስፈልጋል ።','Only UUID V4 is supported at this time.'=>'በአሁኑ ጊዜ የሚደገፈው UUID V4 ብቻ ነው ።','User cannot be added to this site.'=>'ተጠቃሚ ወደዚህ ጣቢያ መታከል አይችልም ።','oEmbed Responses'=>'oEmbed ምላሾች','oEmbed Response'=>'oEmbed ምላሽ','&larr; Go to Categories'=>'እና እጭ ፤ ወደ ምድብ ቦታዎች ሂድ','Your theme can display menus in one location. Select which menu you would like to use.'=>'ጭብጥዎ ምናሌዎችን በአንድ አካባቢ ማሳየት ይችላል ። የትኞቹን መጠቀም እንደሚፈልጉ ይምረጡ ።','No themes found. Try a different search.'=>'የተገኙ ገጽታዎች የሉም ። ሌላ ፍለጋ ይሞክሩ ።','%1$s could not be created: %2$s'=>'%1$s ሊፈጠር አልቻለም ፥  %2$s','%1$s must be between %2$d (inclusive) and %3$d (exclusive)'=>'%1$s በ %2$d (አካታች) እና %3$d (ብቸኛ) መካከል መሆን አለበት ።','%1$s must be between %2$d (inclusive) and %3$d (inclusive)'=>'%1$s በ %2$d (አካታች) እና %3$d (አካታች) መካከል መሆን አለበት ።','Removing %1$s manually will cause PHP warnings. Use the %2$s filter instead.'=>'%1$s በእጅ ማስወገድ PHP ማስጠንቀቂያዎች ምክንያት ይሆናል ። በምትኩ %2$s ማጣሪያ ይጠቀሙ ።','Do not pass %1$s tags to %2$s.'=>'%1$s ታጎችን ወደ %2$s አታሳልፍ ።','%1$s must be between %2$d (exclusive) and %3$d (exclusive)'=>'%1$s ከ %2$d (ብቸኛ) እና %3$d (ብቸኛ) መካከል መሆን አለበት ።','%1$s must be between %2$d (exclusive) and %3$d (inclusive)'=>'%1$s ከ %2$d (ብቸኛ) እና %3$d (አካታች) መካከል መሆን አለበት ።','Only %1$s or %2$s files may be used for header video. Please convert your video file and try again, or, upload your video to YouTube and link it with the option below.'=>'ለርዕስ ቪድዮ %1$s ወይም %2$s ፋይሎች ብቻ ጥቅም ላይ ሊውሉ ይችላሉ ። እባክዎ የቪዲዮ ፋይልዎን ይለውጡ እና እንደገና ይሞክሩ ፣ ወይም ቪዲዮዎን ወደ ዩቱብ ይስቀሉ እና ከታች ካለው አማራጭ ጋር ያገናኙት ።','Upload your video in %1$s format and minimize its file size for best results. Your theme recommends dimensions of %2$s pixels.'=>'በ %1$s ቅርጸት ውስጥ ቪዲዮዎን ይጫኑ እና ለበለጠ ውጤቶች የፋይል መጠኑን ይቀንሱ ። ገጽታዎ የ %2$s ፒክስሎች ልኬቶችን ይመክራል ።','In %1$s, use the %2$s method, not the %3$s function. See %4$s.'=>'በ %1$s ውስጥ ፣ %2$s ዘዴን ተጠቀም ፣ %3$s ተግባር አይደለም ። %4$s ተመልከት ።','Click &#8220;Add new image&#8221; to upload an image file from your computer. Your theme works best with an image with a header width of %s pixels &#8212; you&#8217;ll be able to crop your image once you upload it for a perfect fit.'=>'አዲስ ምስል&#8221 አክል&#8220; ምስል ከኮምፒውተርህ ለመስቀል ጠቅ አድርግ ። ገጽታዎ በ%s Pixel እና # 8212 ፣ እርስዎ እና # 8217 ፣ እርስዎ እና #8217; ለምስልዎን ሙሉ በሙሉ ከሰቀሉት በኋላ በምስል የተሻለ ይሰራል ።','Use %s instead if you do not want the value echoed.'=>'እሴቱ እንዲስተጋባ ካልፈለክ በምትኩ %s ተጠቀም ።','Showing details for theme: %s'=>'ዝርዝሮችን ለ ገጽታ በማሳየት ላይ ፥ %s','Live preview theme: %s'=>'የቀጥታ ገጽታ ፥ %s','No themes found. Try a different search, or %s.'=>'የተገኙ ገጽታዎች የሉም ። የተለየ ፍለጋ ይሞክሩ ፣ ወይም  %s ።','Suggested image dimensions: %1$s by %2$s pixels.'=>'የተጠቆመው የምስል ልኬቶች ፥ %1$s በ %2$s ፒክስሎች ።','Site Icons should be square and at least %s pixels.'=>'የጣቢያ አዶዎች መረባ መሆን አለባቸው እና ቢያንስ %s ፒክስሎች ።','The constant %1$s <strong>is deprecated</strong>. Use the boolean constant %2$s in %3$s to enable a subdomain configuration. Use %4$s to check whether a subdomain configuration is enabled.'=>'ያልተለወጠው %1$s <strong> ከድሮ ዘመን አልፏል </strong> ። የታህድሶ ውቅረት ለማንቃት %3$s የboolean ኢተለዋዋጭ %2$s ይጠቀሙ ። ንዑስ ውቅረት ነቅቷል ወይ የሚለውን ለመፈተሽ %4$s ይጠቀሙ ።','The REST API can no longer be completely disabled, the %s filter can be used to restrict access to the API, instead.'=>'Rest API ከእንግዲህ ወዲያ ሙሉ በሙሉ መሰናከል አይችልም ፣ %s ማጣሪያ ወደ API መዳረሻን ለማገድ ጥቅም ላይ ሊውል ይችላል ፣ ይልቁንም ።','An unexpected error occurred. Something may be wrong with WordPress.org or this server&#8217;s configuration. If you continue to have problems, please try the <a href="%s">support forums</a>.'=>'ያልተጠበቀ ስህተት ተከስቷል። የሆነ ስህተት WordPress.org ላይ ወይም ይህ አገልጋይ &#8217; ውቅረት ላይ ሊሆን ይችላል። ችግሮቹ የሚቀጥሉብወት ከሆነ፣ የወርድፕሬስ መወያያ ሸንጎ ላይ ይሞክሩ <a href="%s"> የእርዳታ ሸንጎወች</a>.','pageUse as featured image'=>'እንደ መለያ ምስ ተጠቀም ','Your theme can display menus in %s location. Select which menu you would like to use.'=>'ጭብጥዎ ምናሌዎችን በአንድ አካባቢ ማሳየት %s ይችላል ። የትኞቹን መጠቀም እንደሚፈልጉ ይምረጡ ።' . "\0" . 'ጭብጥዎ ምናሌዎችን በአንድ አካባቢ ማሳየት %s ይችላል ። የትኞቹን መጠቀም እንደሚፈልጉ ይምረጡ ።','%s matches more than one of the expected formats.'=>'%s ከሚጠበቁት ቅርጸቶች ከአንድ በላይ ይዛመዳል።','%s does not match any of the expected formats.'=>'%s ከማንኛውም ከሚጠበቁ ቅርጸቶች ጋር አይዛመድም።','The post type %1$s is not registered, so it may not be reliable to check the capability "%2$s" against a post of that type.'=>'የፖስታ አይነት %1$s አልተመዘገበም፣ ስለዚህ የ"%2$s" አቅም ከእንደዚህ አይነት ልጥፍ አንጻር መፈተሽ አስተማማኝ ላይሆን ይችላል። ','A structure tag is required when using custom permalinks. <a href="%s">Learn more</a>'=>'ብጁ ቀዋሚሊንክ ሲጠቀሙ የመዋቅር መለያ ያስፈልጋል። <a href="%s">የበለጠ ለመረዳት</a>','The "%s" options group has been removed. Use another settings group.'=>'የ%s አማራጮች ቡድን ተወግዷ