###SITEURL###','No changeset found to take over'=>'ለመረከብ ምንም ለውጥ አልተገኘም።','Sorry, you are not allowed to take over.'=>'ይቅርታ፣ ቦታውን እንድትረከብ አልተፈቀደልህም።','%s is already customizing this site. Do you want to take over?'=>'%s ይህን ጣቢያ አስቀድሞ እያበጀው ነው። መረከብ ትፈልጋለህ?','%s is already customizing this site. Please wait until they are done to try customizing. Your latest changes have been autosaved.'=>'%s ይህን ጣቢያ አስቀድሞ እያበጀው ነው። እባክዎን ለማበጀት እስኪጨርሱ ድረስ ይጠብቁ። የቅርብ ጊዜ ለውጦችዎ በራስ-ሰር ተቀምጠዋል።','themeActivate %s'=>'ነቅተዋል %s','menu locationsView Location'=>'ቦታን ይመልከቱ','Looking for a theme? You can search or browse the WordPress.org theme directory, install and preview themes, then activate them right here.'=>'ጭብጥ እየፈለጉ ነው? የWordPress.org ጭብጥ ማውጫን መፈለግ ወይም ማሰስ፣ ጭብጦችን መጫን እና ቅድመ-ዕይታ ማድረግ፣ ከዚያ እዚህ ማንቃት ይችላሉ።','While previewing a new theme, you can continue to tailor things like widgets and menus, and explore theme-specific options.'=>'አዲስ ገጽታን አስቀድመው በሚመለከቱበት ጊዜ እንደ መግብሮች እና ምናሌዎች ያሉ ነገሮችን ማበጀት እና ጭብጥ-ተኮር አማራጮችን ማሰስ መቀጠል ይችላሉ።','menu locationsView All Locations'=>'ሁሉንም ቦታዎች ይመልከቱ','You&#8217;ll create a menu, assign it a location, and add menu items like links to pages and categories. If your theme has multiple menu areas, you might need to create more than one.'=>'ምናሌ ትፈጥራለህ፣ ቦታ ይመድባል እና እንደ ገፆች እና ምድቦች አገናኞች ያሉ የምናሌ ንጥሎችን ታክላለህ። ጭብጥዎ ብዙ የምናሌ ቦታዎች ካሉት፣ ከአንድ በላይ መፍጠር ሊኖርብዎ ይችላል።','menu locationsWhere do you want this menu to appear?'=>'ይህ ምናሌ የት እንዲታይ ይፈልጋሉ?','menu locations(If you plan to use a menu <a href="%1$s" %2$s>widget%3$s</a>, skip this step.)'=>'(ምናሌ ለመጠቀም ካቀዱ <a href="%1$s" %2$s>መግብር%3$s</a>, ይህን ደረጃ እለፈው.)','Changeset is being edited by other user.'=>'Changeset በሌላ ተጠቃሚ እየተስተካከለ ነው። ','Could not open handle for %1$s to %2$s.'=>'እጀታውን ለ%1$s እስከ %2$s መክፈት አልተቻለም።','Create a menu for this location'=>'ለዚህ አካባቢ ምናሌ ይፍጠሩ','+ Create New Menu'=>'+ አዲስ ምናሌ ፍጠር','Update anyway, even though it might break your site?'=>'ለማንኛውም ያዘምኑ፣ ምንም እንኳን ጣቢያዎን ሊሰብር ቢችልም?','%s is already customizing this changeset. Please wait until they are done to try customizing. Your latest changes have been autosaved.'=>'%s ይህን የለውጥ ስብስብ አስቀድሞ እያበጀው ነው። እባክዎን ለማበጀት እስኪጨርሱ ድረስ ይጠብቁ። የቅርብ ጊዜ ለውጦችዎ በራስ-ሰር ተቀምጠዋል።','%s is already customizing this changeset. Do you want to take over?'=>'%s ይህን የለውጥ ስብስብ አስቀድሞ እያበጀው ነው። መረከብ ትፈልጋለህ? ','The link you followed has expired.'=>'የተከተሉት አገናኝ ጊዜው አልፎበታል።','[deleted]'=>'[ተሰርዟል]','This content was deleted by the author.'=>'ይህ ይዘት በጸሐፊው ተሰርዟል።','tagsMost Used'=>'በብዛት ጥቅም ላይ የዋለ','No archives to show.'=>'ምንም የሚታዩ ማህደሮች የሉም።','Block type names must be strings.'=>'የአግድ አይነት ስሞች ሕብረቁምፊዎች መሆን አለባቸው።','Block type names must not contain uppercase characters.'=>'የአግድ አይነት ስሞች አቢይ ሆሄያትን መያዝ የለባቸውም።','Block type names must contain a namespace prefix. Example: my-plugin/my-custom-block-type'=>'የአግድ ዓይነት ስሞች የስም ቦታ ቅድመ ቅጥያ መያዝ አለባቸው። ምሳሌ፡my-plugin/my-custom-block-type','Block type "%s" is already registered.'=>'የማገጃ አይነት "%s" አስቀድሞ ተመዝግቧል።','Block type "%s" is not registered.'=>'የማገጃ አይነት "%s" አልተመዘገበም።','Page published.'=>'ገጽ ታትሟል።','Post published privately.'=>'ልጥፍ በግል ታትሟል።','Page published privately.'=>'ገጽ በግል ታትሟል።','Post reverted to draft.'=>'ልጥፍ ወደ ረቂቅ ተመልሷል።','Page reverted to draft.'=>'ገጽ ወደ ረቂቅ ተመልሷል።','Post published.'=>'ገጽ ታትሟል።','Post updated.'=>'ፖስት ታድሷል።','categoriesMost Used'=>'በብዛት ጥቅም ላይ የዋለ','Comment %d contains personal data but could not be anonymized.'=>'አስተያየት %d የግል ውሂብ ይዟል ግን ማንነቱ ሊገለጽ አልቻለም።','Dismiss errors'=>'ስህተቶችን አሰናብት','Scrape key check failed. Please try again.'=>'የጭረት ቁልፍ ማረጋገጥ አልተሳካም። እባክዎ ዳግም ይሞክሩ።','Reusable blockAdd New'=>'አዲስ አክል','post type general nameReusable blocks'=>'እንደገና ጥቅም ላይ ሊውሉ የሚችሉ መደቦች','post type singular nameReusable block'=>'እንደገና ጥቅም ላይ ሊውሉ የሚችሉ መደቦች','add new from admin barPage'=>'ገጽ','Your site at %1$s is active. You may now log in to your site using your chosen username of &#8220;%2$s&#8221;. Please check your email inbox at %3$s for your password and login instructions. If you do not receive an email, please check your junk or spam folder. If you still do not receive an email within an hour, you can <a href="%4$s">reset your password</a>.'=>'መለያወ ንቁ ሆኗል። አሁን የመረጡትን &#8220;%2$s&#8221; በመጠቀም ወደ ድረገጹ <a href="%1$s">መግባት</a> ይችላሉ። ለማለፊያ ቃልወና ለመግቢያ መመሪያ ኢ-ፖስታ ገቢ መልእክትወን %3$s ያጣሩ። ኢ-ፖስታ ካልደረሰወት የአይፈለጌ ወይም የብላሽ አቃፊውን ያጣሩ። እስካሁን ድረስ በአንድ ሰአት ውስጥ ኢ-ፖስታ ካልደረሰወት <a href="%4$s">ማለፊያ ቃልፎን ይጠግኑ</a>።','Do you really want to <a href="%s">log out</a>?'=>'የምር <a href="%s">መውጣት</a> ይፈልጋሉ?','Privacy Policy'=>'የግላዊነት ፖሊሲ ','Save my name, email, and website in this browser for the next time I comment.'=>'በዚህ አሳሽ ውስጥ ስሜን ፣ ኢሜይልን እና ድር ጣቢያን ለቀጣዩ ጊዜ አስተያየት ስሰጥ ያስቀምጡ ። ','Post scheduled.'=>'የጊዜ ሰሌዳ የተያዘለት ። ','Page scheduled.'=>'ገጽ የጊዜ ሰሌዳ ተይዞለታል ። ','Replace image'=>'ምስል ተካ ','Embed'=>'ክተት ','Classic Block Keyboard Shortcuts'=>'ንቡር ብሎክ የቁልፍ ሰሌዳ አቋራጮች ','A variable mismatch has been detected.'=>'ተለዋዋጭ መቀየሪያ ተገኝቷል ። ','This theme failed to load properly and was paused within the admin backend.'=>'ይህ ጭብጥ በአግባቡ መጫን አልተሳካም እንዲሁም በአስተዳዳሪው ምትኬ ውስጥ ቆሟል ። ','Unable to submit this form, please try again.'=>'ይህንን ቅጽ ማስገባት አልተቻለም ፣ እባክዎ እንደገና ይሞክሩ ። ','Could not insert site into the database.'=>'ጣቢያን ወደ ውሂብ ጎታው ማስገባት አልቻለም ። ','Site ID must not be empty.'=>'የጣቢያ መታወቂያ ባዶ መሆን የለበትም ። ','Could not update site in the database.'=>'በውሂብ ጎታው ውስጥ ጣቢያውን ማዘመን አልቻለም ። ','Could not delete site from the database.'=>'ጣቢያ ከ ውሂብ ጎታው መሰረዝ አልቻለም ። ','Site domain must not be empty.'=>'የጣቢያ ጎራ ባዶ መሆን የለበትም ። ','Site path must not be empty.'=>'የጣቢያ ዱካ ባዶ መሆን የለበትም ። ','Site network ID must be provided.'=>'የጣቢያ አውታረ መረብ መታወቂያ ሊቀርብለት ይገባል ። ','Both registration and last updated dates must be provided.'=>'ምዝገባውም ሆነ የመጨረሻ የዘመነ ቀኖች መቅረብ አለባቸው ። ','Both registration and last updated dates must be valid dates.'=>'ምዝገባውም ሆነ የመጨረሻ የዘመነ ቀኖች ትክክለኛ ቀናት መሆን አለባቸው ። ','Site with the ID does not exist.'=>'መታወቂያ ያለው ጣቢያ የለም ። ','The site appears to be already initialized.'=>'ጣቢያው አስቀድሞ የተቀናበረ ይመስላል ። ','The site appears to be already uninitialized.'=>'ጣቢያው አስቀድሞ ያልተወሰነ ይመስላል ። ','Your comment is awaiting moderation. This is a preview; your comment will be visible after it has been approved.'=>'የምትሰጠው ሐሳብ ልከኛ መሆንን የሚጠብቅ ነው ። ይህ ቅድመ እይታ ነው ፤ አስተያየትዎ ከጸደቀ በኋላ የሚታይ ይሆናል ። ','Could not retrieve site data.'=>'የጣቢያ ውሂብ ማምጣት አልተቻለም ። ','Update PHP'=>'ስልክ አዘምን ','Quote from Hello Dolly song, by Jerry Herman:'=>'ከሄሎ ዶሊ መዝሙር ፣ ከጄሪ ሄርማን የተወሰደ ','Exit Recovery Mode'=>'የመልሶ ማቋቋም ሁነታ ውጣ ','Invalid cookie format.'=>'ልክ ያልኾነ ብስኩት ቅርጸት ። ','Keep widget settings and move it to the inactive widgets'=>'የማስፋት ቅንጅቶችን ያቆዩ እና ወደ አገልግሎት ወደማይሰጡ መጡ ያንቀሳቅሱት ','Recovery Mode not initialized.'=>'የማገገሚያ ሁነታ አልተጀመረም ። ','Invalid recovery key format.'=>'ልክ ያልሆነ ወደነበረበት መመለሻ ቁልፍ ቅርጸት ። ','Invalid recovery key.'=>'ልክ ያልሆነ መልሶ ማግኛ ቁልፍ ። ','Recovery key expired.'=>'መልሶ ማገገም ቁልፍ ጊዜው አልፎበታል ። ','Could not update the email last sent time.'=>'ባለፈው የተላከውን ኢሜይል ማዘመን አልቻለም ። ','Error not caused by a plugin or theme.'=>'በplanner ወይም ገጽታ ስህተት አይመጣም ። ','Failed to store the error.'=>'ስህተቱን ማከማቸት አልተቻለም ። ','Exit recovery mode link expired.'=>'ከመለያ ሁነታ አገናኝ ውጣ ። ','Failed to exit recovery mode. Please try again later.'=>'ከ መልሶ ማግኛ ሁነታ ለመውጣት አልተሳካም ። እባክዎ ቆይተው እንደገና ይሞክሩ ። ','Edit gallery'=>'ማእከል አርትዕ ','Restore from Trash'=>'ከጥራጊው ወደ ነበረበት መልስ ','Move to Trash'=>'ወደ ትራፊሽ አንቀሳቅስ ','Error occurred on a non-protected endpoint.'=>'ስሕተት የደረሰው ጥበቃ ባልተደረገለት ጫፍ ላይ ነበር ። ','Please contact your host for assistance with investigating this issue further.'=>'ይህን ችግር የበለጠ ከመመርመር ጋር እባክዎ ለእርዳታ አስተናጋጅዎን ያነጋግሩ ። ','Allow people to submit comments on new posts.'=>'ሰዎች አዲስ በሚወጡ ጽሑፎች ላይ ሐሳብ እንዲሰጡ ፍቀድ ። ','Your browser cannot upload files'=>'አሳሽዎ ፋይሎችን መስቀል አይችልም ','Attachment Preview'=>'የአባሪ ቅድመ ዕይታ ','Caption&hellip;'=>'ካፕሽን&hellip; ','Video title&hellip;'=>'የቪዲዮ ርእስ&hellip; ','Audio title&hellip;'=>'የድምጽ አርእስት&hellip; ','Media title&hellip;'=>'የሚዲያ ርእስ&hellip; ','Cannot resize the image. Both width and height are not set.'=>'ምስሉን መያዝ አይችልም ። ወርድም ሆነ ቁመት አልተቀመጠም ። ','User&#8217;s comment data.'=>'ተጠቃሚ&#8217; ዎች የአስተያየት ውሂብ ። ','The %1$s, %2$s, and %3$s values can be edited to set the video track language and kind.'=>'የቪዲዮውን የመከታተያ ቋንቋ እና ደግ ለማዘጋጀት %1$s ፣ %2$s ፣ እና %3$s እሴቶች አርትዕ ማድረግ ይችላሉ ። ','Manage Documents'=>'ሰነዶችን አስተዳድር ','Manage Archives'=>'ቤተ መዛግብትን አስተዳድር ','No media items found. Try a different search.'=>'ምንም የሚዲያ ንጥሎች አልተገኙም ። ሌላ ፍለጋ ይሞክሩ ። ','The image cannot be rotated because the embedded meta data cannot be updated.'=>'ምስሉ ሊሽከረከር አይችልም ምክንያቱም የተሸጎጠው ሜታ ውሂብ ሊዘምን አይችልም ። ','There has been a critical error on this website. Please check your site admin email inbox for instructions.'=>'በዚህ ድረገጽ ላይ ወሳኝ ስህተት ተፈጥሯል ። እባክዎ መመሪያ ለማግኘት የጣቢያዎን አስተዳዳሪ የኢሜይል ገቢ ሳጥን ይፈትሹ ። ','There has been a critical error on this website, putting it in recovery mode. Please check the Themes and Plugins screens for more details. If you just installed or updated a theme or plugin, check the relevant page for that first.'=>'በዚህ ድረገጽ ላይ አስጊ ስህተት ተፈጥሯል ፣ በማገገሚያ ሁነታ ላይ አስቀምጦታል ። እባክዎ ለተጨማሪ ዝርዝሮች የነውጦች እና የፕሉጊኖች ስክሪን ላይ ይፈትሹ ። አንድ ጭብጥ ወይም ፕሉጊን ብቻ ከተጫንክ ወይም ካዘምንክ ለዚያ የመጀመሪያ አግባብ ያለውን ገጽ ፈትሽ ። ','There has been a critical error on this website.'=>'በዚህ ድረገጽ ላይ ወሳኝ ስህተት ተፈጥሯል ። ','Block name must be a string.'=>'የእግድ ስም ሕብረቁምፊ መሆን አለበት ። ','Block style name must be a string.'=>'የእግድ ቅጥ ስም ሕብረቁምፊ መሆን አለበት ። ','Current plugin: %1$s (version %2$s)'=>'የአሁኑ ፕሉጊን ፥ %1$s (ስሪት %2$s) ','Nav menu locations must be strings.'=>'የናስ ምናሌ ቦታዎች አውታሮች መሆን አለባቸው ። ','Sorry, this method is not supported.'=>'ይቅርታ ፣ ይህ ዘዴ አይደገፍም ። ','HTTP redirect status code must be a redirection code, 3xx.'=>'HTTP የሥራ መደብ ኮድ ቀይ የማስተካከያ ኮድ ፣ 3xx መሆን አለበት ። ','Previous and next months'=>'ቀዳሚ እና ቀጣይ ወራት ','Namespace must not start or end with a slash.'=>'የስሞች መጠን በሰሌዳ መጀመር ወይም መጨረስ የለበትም ። ','Edit Profile'=>'መገለጫ አርትዕ ','When registering a default meta value the data must match the type provided.'=>'ነባሪ ሜታ እሴት ሲመዘግብ ውሂቡ ከቀረበው ዓይነት ጋር ማዛመድ አለበት ። ','Please consider writing more inclusive code.'=>'እባክዎ ተጨማሪ አካታች ኮድ ለመጻፍ ያስቡ ። ','Invalid hex color.'=>'ልክ ያልኾነ የሂሳብ ቀለም ። ','Could not update comment in the database.'=>'በውሂብ ጎታው ውስጥ አስተያየት ማዘመን አልቻለም ። ','Could not insert attachment into the database.'=>'አባሪ ወደ ውሂብ ጎታው ማስገባት አልቻለም ። ','Add media'=>'ሚዲያ አክል ','Attachment details'=>'አባሪ ዝርዝሮች ','Pattern name must be a string.'=>'ንድፍ ስም አውታር መሆን አለበት ። ','Pattern title must be a string.'=>'ንድፍ አርእስት መሆን አለበት ። ','Pattern content must be a string.'=>'ንድፍ ይዘት ኅብረቁምፊ መሆን አለበት ። ','<strong>Error</strong>: Site URL you&#8217;ve entered is already taken.'=>'<strong>ስሕተት</strong>: የጣቢያ URL ወደ መጋረጃ ቀድሞ ተወስዷል ። ','<strong>Error</strong>: There was a problem creating site entry.'=>'<strong>ስሕተት</strong>: የጣቢያ መግቢያ ለመፍጠር ችግር ነበር ። ','Return a %1$s or %2$s object from your callback when using the REST API.'=>'Rest APIን ሲጠቀሙ ከጥሪ የራስዎ %1$s ወይም %2$s ነገር ይመልሱ ። ','Block pattern category name must be a string.'=>'የእግድ ንድፍ ስም አውታር መሆን አለበት ። ','Embed Handler'=>'እጅ ሰሪ ','Could not update attachment in the database.'=>'አባሪን በውሂብ ጎታው ውስጥ ማዘመን አልቻለም ። ','The REST API route definition for %1$s is missing the required %2$s argument. For REST API routes that are intended to be public, use %3$s as the permission callback.'=>'ለ %1$s የ REST API መለያ ተፈላጊውን %2$s ክርክር አጥቷል ። ለሕዝብ እንዲሆኑ ለታሰቡ ለ REST API መስመሮች ፣ እንደ ፈቃድ ጥሪ መመለሻ %3$s ያህል ይጠቀሙ ። ','The handler for the route is invalid.'=>'መንገድ ጠራጊው ተገቢ አይደለም ። ','Could not parse the path.'=>'መንገዱን መተንተን አልቻለም ። ','The requested route does not support batch requests.'=>'የተጠየቀው መንገድ ለቦታ ጥያቄ ድጋፍ አይሰጥም ። ','Invalid parameters.'=>'ልክ ያልሆኑ መመጠኛዎች ። ','Sorry, you are not allowed to manage application passwords for this user.'=>'ይቅርታ ፣ ለዚህ ተጠቃሚ የመተግበሪያ የይለፍ ቃሎችን ማስተዳደር አልተፈቀደም ። ','Application password not found.'=>'የመተግበሪያ የይለፍ ቃል አልተገኘም ። ','%1$s must be a multiple of %2$s.'=>'%1$s ከ %2$s ብዙ መሆን አለበት ። ','Could not find an application password with that id.'=>'ከዚያ ጣዖት ጋር የመተግበሪያ የይለፍ ቃል ማግኘት አልቻለም ። ','Could not delete application password.'=>'የመተግበሪያ የይለፍ ቃል መሰረዝ አልተቻለም ። ','Could not delete application passwords.'=>'የመተግበሪያ የይለፍ ቃሎችን መሰረዝ አልተቻለም ። ','Add new Reusable block'=>'አዲስ ዳግም ጥቅም ላይ የዋለ ታግ አክል ','New Reusable block'=>'አዲስ ዳግም የሚከሰት እገዳ ','Edit Reusable block'=>'እንደገና የሚደገም ገደብ አርትዕ ','View Reusable block'=>'ዳግም የሚመጣ አግድ እይ ','All Reusable blocks'=>'ሊተመኑ የሚችሉ ነገሮች ','Search Reusable blocks'=>'ፍለጋ ዳግም የሚቋቋሙ ማዕከላትን ','No reusable blocks found.'=>'ለመዳን የሚያግዱ ነገሮች አልተገኙም ። ','No reusable blocks found in Trash.'=>'በሽራሽ ውስጥ እንደገና ለመኖሪያነት የሚያገለግሉ ማዕድናት አልተገኙም ። ','Filter reusable blocks list'=>'ማጣሪያ ዳግም የሚመጣ መሰናክል ዝርዝር ','Reusable blocks list navigation'=>'እንደገና ማረጋገጥ የከለከለ አሰሳ ዝርዝር ','Reusable blocks list'=>'ሊደረስባቸው የሚችሉ የእግዶች ዝርዝር ','Reusable block published.'=>'እንደገና የሚታተም እገዳ ። ','Reusable block published privately.'=>'ለብቻ የታተመ ሌላ እገዳ ። ','Reusable block reverted to draft.'=>'ወደ ረቂቁ ዳግም የሚከሰት እገዳ ። ','Reusable block scheduled.'=>'ዳግም ሊደረስበት የሚችል ገደብ የጊዜ ሰሌዳ ተይዞለታል ። ','This file is only loaded for backward compatibility with SimplePie 1.2.x. Please consider switching to a recent SimplePie version.'=>'ይህ ፋይል የሚጫነው ከቀናሊፕፒ 1.2.x ጋር ላለው የኋለኛ ተኳሃኝ ብቻ ነው ። እባክዎ ወደ የቅርብ ጊዜ ቀላልፒ ስሪት ይቀይሩ ። ','[block rendering halted]'=>'[ግልጋሎትን ማቆም] ','Sorry, you are not allowed to list application passwords for this user.'=>'ይቅርታ ፣ ለዚህ ተጠቃሚ የመተግበሪያ የይለፍ ቃሎችን ለመዘርዘር አልተፈቀደም ። ','Sorry, you are not allowed to read this application password.'=>'ይቅርታ ፣ ይህን የመተግበሪያ የይለፍ ቃል እንዲያነቡ አልተፈቀደም ። ','Sorry, you are not allowed to create application passwords for this user.'=>'ይቅርታ ፣ ለዚህ ተጠቃሚ የመተግበሪያ የይለፍ ቃሎችን መፍጠር አልተፈቀደም ። ','Sorry, you are not allowed to edit this application password.'=>'ይቅርታ ፣ ይህን የመተግበሪያ የይለፍ ቃል አርትዕ ለማድረግ አልተፈቀደም ። ','Sorry, you are not allowed to delete application passwords for this user.'=>'ይቅርታ ፣ ለዚህ ተጠቃሚ የመተግበሪያ የይለፍ ቃሎችን ለመሰረዝ አልተፈቀደም ። ','Sorry, you are not allowed to delete this application password.'=>'ይቅርታ ፣ ይህን የመተግበሪያ የይለፍ ቃል ለመሰረዝ አልተፈቀደም ። ','The authenticated application password can only be introspected for the current user.'=>'የተረጋገጠው የመተግበሪያ የይለፍ ቃል ለአሁኑ ተጠቃሚ ብቻ ሊታወቅ ይችላል ። ','Cannot introspect application password.'=>'የትግበራ የይለፍ ቃልን ማስገባት አይቻልም ። ','Event timestamp must be a valid Unix timestamp.'=>'የክስተት የጊዜ ሰሌዳ ልክ የኾነ የIIS ወቅታዊ ሰሌዳ መሆን አለበት ። ','A plugin prevented the event from being scheduled.'=>'አንድ ፕሉጊን ክስተቱ በታቀደለት ጊዜ እንዳይከናወን አገደው ። ','A duplicate event already exists.'=>'የተደጋገመ ክስተት ቀድሞም አለ ። ','A plugin disallowed this event.'=>'አንድ ፕሉጊን ይህን ክስተት ጣለ ። ','Event schedule does not exist.'=>'የክስተት ፕሮግራም የለም ። ','A plugin prevented the event from being rescheduled.'=>'አንድ ፕሉጊን ክስተቱ ዳግም እንዳይከሰት አገደው ። ','A plugin prevented the event from being unscheduled.'=>'አንድ ፕሉጊን ክስተቱ ሳይጠቀስ እንዳይቀር አገደው ። ','A plugin prevented the hook from being cleared.'=>'አንድ ፕሉጊን መንጠቆው እንዳይነጠቅ አገደው ። ','The cron event list could not be saved.'=>'የክስተት ዝርዝሩ ሊቀመጥ አልቻለም ። ','%1$s is not %2$s.'=>'%1$s አይደለም %2$s። ','It looks like the response did not come from this site.'=>'ምላሹ ከዚህ ጣቢያ የመጣ አይመስልም ። ','Each application name should be unique.'=>'የእያንዳንዱ መተግበሪያ ስም ልዩ መሆን አለበት ። ','Filter by category'=>'በምድብ አጣራ ','The %1$s parameter must be an array. To pass arbitrary data to scripts, use the %2$s function instead.'=>'%1$s መመጠኛ ድርድር መሆን አለበት ። ለቅዱሳት መጻህፍት የግዴለሽነት ውሂብ ለማሰለፍ በምትኩ %2$s ተግባር ተጠቀም ። ','HTTPS request failed.'=>'የ HTTPS ጥያቄ አልተሳካም ። ','SSL verification failed.'=>'የSSL ማረጋገጫ አልተሳካም ። ','This content is password protected.'=>'ይህ ይዘት በይለፍ ቃል የተጠበቀ ነው ። ','No theme is defined for this template.'=>'ለዚህ ዝግጁ ይዞታ ምንም ገጽታ አልተበየነም ። ','No matching template found.'=>'ምንም ተዛማጅ ዝግጁ ይዞታ አልተገኘም ። ','No matching template found'=>'ተዛማጅ ዝግጁ ይዞታ አልተገኘም ','(Home link, opens in a new tab)'=>'(Home አገናኝ ፣ በአዲስ ትር ውስጥ ይከፈታል) ','Site logo.'=>'የጣቢያ አርማ ። ','Add New Template'=>'አዲስ ዝግጁ ይዞታ አክል ','New Template'=>'አዲስ ዝግጁ ይዞታ ','Edit Template'=>'ዝግጁ ይዞታ አርትዕ ','View Template'=>'ዝግጁ ይዞታ ተመልከት ','Search Templates'=>'ዝግጁ ይዞታዎችን ይፈልጉ ','Parent Template:'=>'ወላጅ ዝግጁ ይዞታ ፥ ','No templates found.'=>'ምንም ቅርጸ ይዘቶች አልተገኙም ። ','No templates found in Trash.'=>'በትራሽ ውስጥ ምንም ቅርጸ ይዘቶች አልተገኙም ። ','Template archives'=>'ዝግጁ ይዞታ ማህደር ','Insert into template'=>'ወደ ዝግጁ ይዞታ አስገባ ','Uploaded to this template'=>'ወደዚህ ዝግጁ ይዞታ ተሰቅሏል ','Filter templates list'=>'ቅርጸ ይዘቶች ዝርዝር አጣራ ','Templates list navigation'=>'አብነቶች አሰሳ ዝርዝር ','Templates list'=>'የቅርጸ ይዘቶች ዝርዝር ','Templates to include in your theme.'=>'ጭብጥህ ውስጥ ለማካተት ዝግጁ ይዘቶች ። ','Cookie check failed'=>'ኩኪ ፍተሻ አልተሳካም ','Reusable block updated.'=>'ዳግም የሚመጣ እገዳ ዘምኗል ። ','Edit site'=>'ጣቢያ አርትዕ ','General templates often perform a specific role like displaying post content, and are not tied to any particular area.'=>'አጠቃላይ አብነቶች አብዛኛውን ጊዜ የድህረ ገፅ ይዘትን የማሳየት አይነት የተወሰነ ሚናን ያከናውናሉ ፣ እናም ለየትኛውም አካባቢ አይሰሩም ። ','The Header template defines a page area that typically contains a title, logo, and main navigation.'=>'የርእስ ዝግጁ ይዞታ በመደበኛነት ርእስ ፣ አርማ እና ዋና ዳሰሳ የያዘ የገጽ አካባቢን ይወስናል ። ','The Footer template defines a page area that typically contains site credits, social links, or any other combination of blocks.'=>'የጀርመኑ አብነት አብዛኛውን ጊዜ የጣቢያ ውሱንነት ፣ ማህበራዊ አገናኞች ወይም ማንኛውም ሌላ ማዕድናት የያዘ የገጽ አካባቢን ይወስናል ። ','Displays posts.'=>'ፖስታዎችን ያሳያል ። ','Displays a single post or page.'=>'አንድ ነጠላ ፖስት ወይም ገጽ ያሳያል ። ','Displays a single post.'=>'አንድ መላዕክት ያሳያል ። ','Displays a single page.'=>'አንድ ነጠላ ገጽ ያሳያል ። ','Displays post categories, tags, and other archives.'=>'የድህረ ገጽ ምድቦች ፣ መለያዎች እና ሌሎች ማህደሮች ያሳያል ። ','Displays latest posts written by a single author.'=>'በአንድ ደራሲ የተጻፉ የቅርብ ጊዜ ጽሑፎችን ያሳያል ። ','Displays latest posts in single post category.'=>'የቅርብ ጊዜ ፖስታዎችን በነጠላ ድህረ ገጽ ላይ ያሳያል ። ','Displays latest posts from a single post taxonomy.'=>'የቅርብ ጊዜ ፖስታዎችን ከነጠላ ድህረ ምረቃ ላይ ያሳያል ። ','Displays posts from a specific date.'=>'ከተወሰነ ቀን ጀምሮ መግለጫዎችን ያሳያል ። ','Displays individual media items or attachments.'=>'የግለሰብ ሚዲያዎች ንጥሎችን ወይም አባሪዎችን ያሳያል ። ','Displays the privacy policy page.'=>'የግላዊነት ፖሊሲ ገጽ ያሳያል ። ','Displays when no content is found.'=>'ይዘት በማይገኝ ጊዜ ያሳያል ። ','Zip Export not supported.'=>'ኤክስፖርት አልተደገፈም ። ','Unable to open export file (archive) for writing.'=>'ለጽሁፍ ወደ ውጭ የሚላክ ፋይል (ቅስት) መክፈት አልተቻለም ። ','The calendar block is hidden because there are no published posts.'=>'የታተሙ ጽሑፎች ስለሌሉ የቀን መቁጠሪያ እገዳ ተደብቋል ። ','Post Format Link'=>'የቅርጸት አገናኝ ለጥፍ ','A link to a post format'=>'ወደ ድህረ ቅርጸት አገናኝ ','Open menu'=>'ምናሌ ክፈት ','Close menu'=>'ምናሌ ዝጋ ','Block style name must not contain any spaces.'=>'የአዝማሚያ ቅጥ ስም ምንም ቦታዎች መያዝ የለበትም ። ','<strong>Error</strong>: Please fill the required fields.'=>'<strong>ስሕተት</strong>: እባክህ ተፈላጊውን መስክ ሙላ ። ','This theme doesn\'t support Customizer.'=>'ይህ ገጽታ ብጁአዚዘርን አይደግፍም ። ','Sorry, you are not allowed to upload this file type.'=>'ይቅርታ ፣ ይህን የፋይል አይነት ለመስቀል አልተፈቀደም ። ','Add New Template Part'=>'አዲስ ዝግጁ ክፍል አክል ','New Template Part'=>'አዲስ ዝግጁ ይዞታ ክፍል ','Edit Template Part'=>'ዝግጁ ይዞታ አርትዕ ','View Template Part'=>'ዝግጁ ክፍል ይመልከቱ ','Search Template Parts'=>'ዝግጁ ይዞታዎችን ይፈልጉ ','Parent Template Part:'=>'ወላጅ ዝግጁ ክፍል ፥ ','No template parts found.'=>'ምንም ቅርጸ ይዘት አልተገኘም ። ','No template parts found in Trash.'=>'በትራሽ ውስጥ ምንም ቅርጸ ይዘት ያላቸው ክፍሎች አልተገኙም ። ','Template part archives'=>'ዝግጁ ይዞታ ክፍል መዛግብት ','Insert into template part'=>'ወደ ቅርጸ ይዘት ክፍል አስገባ ','Uploaded to this template part'=>'ወደዚህ ዝግጁ ይዞታ ክፍል ተሰቅሏል ','Filter template parts list'=>'የቅንብር ደንብ የክፍሎች ዝርዝር አጣራ ','Template parts list navigation'=>'የ ዝግጁ ይዞታ ክፍሎች አሰሳ ዝርዝር ','Template parts list'=>'ዝግጁ ይዞታ ክፍሎች ዝርዝር ','Template parts to include in your templates.'=>'ዝግጁ ይዞታዎችን በቅንብሮችዎ ውስጥ ለማካተት የዝግጅት ክፍሎቹን ያካትቱ ። ','Global styles to include in themes.'=>'ዓለም አቀፋዊ ስልቶች በመልዕክቶች ውስጥ ማካተት አለባቸው ። ','Add New Navigation Menu'=>'አዲስ የዳሰሳ ምናሌ አክል ','New Navigation Menu'=>'አዲስ የዳሰሳ ምናሌ ','Edit Navigation Menu'=>'የዳሰሳ ምናሌ አርትዕ ','View Navigation Menu'=>'የዳሰሳ ምናሌ ይመልከቱ ','Search Navigation Menus'=>'ፍለጋ ምናሌ ይፈልጉ ','Parent Navigation Menu:'=>'የወላጆች ዳሰሳ ምናሌ ፦ ','No Navigation Menu found.'=>'የአሰሳ ምናሌ አልተገኘም ። ','No Navigation Menu found in Trash.'=>'በጥራሽ ውስጥ ምንም የአሰሳ ምናሌ አልተገኘም ። ','Navigation Menu archives'=>'የዳሰሳ ምናሌ ቅስት ','Insert into Navigation Menu'=>'ወደ መዳሰስ ምናሌ ያስገቡ ','Uploaded to this Navigation Menu'=>'ወደዚህ የዳሰሳ ምናሌ ተሰቅሏል ','Filter Navigation Menu list'=>'የዳሰሳ መኑ ዝርዝርን አጣራ ','Navigation Menus list navigation'=>'የዳሰሳ መዝገብ አሰሳ ','Navigation Menus list'=>'የዳሰሳ መዝገብ ','Navigation menus that can be inserted into your site.'=>'ወደ ጣቢያዎ ሊገባ የሚችል የአሰሳ መዝገብ ። ','The name is how it appears on your site.'=>'ስሙ በእርስዎ ጣቢያ ላይ እንዴት ይታያል? ','The &#8220;slug&#8221; is the URL-friendly version of the name. It is usually all lowercase and contains only letters, numbers, and hyphens.'=>'ስሙ URL-ወዳጃዊ ስሪት ነው ስሉግ &#8221; ። አብዛኛውን ጊዜ የሁሉም ትንሹ ፊደላት ፣ ቁጥሮችና ግብዞች ብቻ ናቸው ። ','Assign a parent term to create a hierarchy. The term Jazz, for example, would be the parent of Bebop and Big Band.'=>'ተዋረድ ለመፍጠር የወላጅ ስም ይስጡ ። ለምሳሌ ጃዝ የሚለው ቃል የቤቦፕና የቢግ ባንድ ወላጅ ነው ። ','The description is not prominent by default; however, some themes may show it.'=>'ይህ መግለጫ በነባሪነት የታወቀ አይደለም ፤ ይሁን እንጂ አንዳንድ ገጽታዎች ሊያሳዩት ይችላሉ ። ','Site icon.'=>'የጣቢያ አዶ ። ','You should specify an action to be verified by using the first parameter.'=>'የመጀመሪያውን ግቤት በመጠቀም የአንድ ጊዜ እርምጃ ጽድቀት ማሳየት ይችላሉ።','The %s table is not installed. Please run the network database upgrade.'=>'የ%s ሠንጠረዥ አልተጫነም። እባክዎ የአውታረ መረብ ዳታቤዝ ማሻሻያውን ያሂዱ።','REST API routes must be registered on the %s action.'=>'የREST API መስመሮች በ%s እርምጃ ላይ መመዝገብ አለባቸው።','%s Comment in moderation'=>'%s በመጠኑ አስተያየት ይስጡ' . "\0" . '%s አስተያየቶች በመጠኑ','User roleAuthor'=>'ደራሲ','User roleContributor'=>'አበርካቾች','User roleSubscriber'=>'ተመዝጋቢ','In reply to: %s'=>'ለ፡%s ምላሽ','When registering an "array" setting to show in the REST API, you must specify the schema for each array item in "show_in_rest.schema.items".'=>'በREST API ውስጥ ለማሳየት የ"ድርድር" ቅንብርን ሲመዘግቡ ለእያንዳንዱ የድርድር ንጥል ነገር በ"show_in_rest.schema.items" ውስጥ መግለጽ አለቦት።','In reply to %s.'=>'ለ%s ምላሽ።','The post status %1$s is not registered, so it may not be reliable to check the capability "%2$s" against a post with that