%2$s','Menus can be displayed in locations defined by your theme or in <a href="%s">widget areas</a> by adding a &#8220;Navigation Menu&#8221; widget.'=>'ምናሌዎች በገጽታዎ በተገለጹ አካባቢዎች ወይም በ<a href="%s">መግብር ቦታዎች</a> ላይ&#8220; የአሰሳ ምናሌን በመጨመ&#8221; መግብር.','<a href="%1$s">Please update WordPress</a>, and then <a href="%2$s">learn more about updating PHP</a>.'=>'<a href="%1$s">እባክዎ ወርድፕረስ ያዘምኑ</a> እና ከዚያ <a href="%2$s">PHPን ስለማዘመን</a> የበለጠ ይወቁ።','<a href="%s">Please update WordPress</a>.'=>'<a href="%s">እባክዎ ወርድፕረስ ያዘምኑ</a>።','Please see <a href="%s">Debugging in WordPress</a> for more information.'=>'ለበለጠ መረጃ እባክዎን <a href="%s">በወርድፕረስ ውስጥ ማረም</a>ን ይመልከቱ።','Howdy!

Since WordPress 5.2 there is a built-in feature that detects when a plugin or theme causes a fatal error on your site, and notifies you with this automated email.
###CAUSE###
First, visit your website (###SITEURL###) and check for any visible issues. Next, visit the page where the error was caught (###PAGEURL###) and check for any visible issues.

###SUPPORT###

If your site appears broken and you can\'t access your dashboard normally, WordPress now has a special "recovery mode". This lets you safely login to your dashboard and investigate further.

###LINK###

To keep your site safe, this link will expire in ###EXPIRES###. Don\'t worry about that, though: a new link will be emailed to you if the error occurs again after it expires.

When seeking help with this issue, you may be asked for some of the following information:
###DEBUG###

###DETAILS###'=>'ሰላም!

ከወርድፕረስ 5.2 ጀምሮ ተሰኪ ወይም ገጽታ በጣቢያዎ ላይ ገዳይ ስህተት ሲፈጥር የሚያውቅ እና በዚህ አውቶሜትድ ኢሜል የሚያሳውቅ አብሮ የተሰራ ባህሪ አለ
###CAUSE###
በመጀመሪያ ድህረ ገጽዎን ይጎብኙ (###SITEURL###) እና ለሚታዩ ችግሮች ያረጋግጡ። በመቀጠል ስህተቱ የተያዘበትን ገጽ ይጎብኙ (###PAGEURL###) እና የሚታዩ ችግሮችን ያረጋግጡ።

###SUPPORT###

የእርስዎ ጣቢያ የተበላሸ መስሎ ከታየ እና የእርስዎን ዳሽቦርድ በመደበኛነት መድረስ ካልቻሉ፣ WordPress አሁን ልዩ "የመልሶ ማግኛ ሁኔታ" አለው። ይህ በደህና ወደ ዳሽቦርድዎ እንዲገቡ እና የበለጠ እንዲመረምሩ ያስችልዎታል።

###LINK###

የጣቢያህን ደህንነት ለመጠበቅ ይህ ማገናኛ በ###EXPIRES### ጊዜው ያልፍበታል። ለዛ አይጨነቁ፣ ቢሆንም፡ ጊዜው ካለፈበት በኋላ ስህተቱ እንደገና ከተከሰተ አዲስ አገናኝ ኢሜይል ይላክልዎታል።

በዚህ ጉዳይ ላይ እርዳታ በሚፈልጉበት ጊዜ ከሚከተሉት መረጃዎች ውስጥ አንዳንዶቹን ሊጠየቁ ይችላሉ፡-
