###DETAILS###','About WordPress'=>'ስለ ወርድፕረስ','Learn more about troubleshooting WordPress.'=>'ወርድፕረስ ለመጠገን ተጨማሪ ይወቁ ። ','In this case, WordPress caught an error with one of your plugins, %s.'=>'በዚህ ሁኔታ ፣ ወርድፕረስ በአንዱ ፕሪንተሮችህ ፣ %s ላይ ስህተት ይዞ ነበር ።','In this case, WordPress caught an error with your theme, %s.'=>'በዚህ ሁኔታ ፣ ወርድፕረስ ከ ጭብጥዎ ፣ %s ጋር ስህተት ይዞ ነበር ።','new WordPress Loop'=>'አዲስ የወርድፕረስ ዙሮሽ','You appear to have already installed WordPress. To reinstall please clear your old database tables first.'=>'ከዚህ በፊት ወርድፕረስ የጫኑት ይመስላል። እንደገና ለመጫን አሮጌውን የውሂብ ጎታዎን ሰንጠረዥ መጀመሪያ ያጽዱት።','WordPress Address (URL)'=>'ወርድፕረስ አድራሻ (URL) ','WordPress Media'=>'ወርድፕረስ ሚዲያ','WordPress Comments'=>'ወርድፕረስ አስተያየቶች','WordPress Embed'=>'ወርድፕረስ ክተት','WordPress &rsaquo; Success'=>'ወርድፕረስ &rsaquo; ስኬት','Read the <a href="%s" target="_blank">Debugging a WordPress Network</a> article. Some of the suggestions there may help you figure out what went wrong.'=>'የ<a href="%s" target="_blank">የወርድፕረስ ኔትወርክን ማረም</a> ጽሑፉን ያንብቡ። እዚያ ያሉት አንዳንድ ጥቆማዎች ምን ችግር እንደተፈጠረ ለማወቅ ሊረዱዎት ይችላሉ።','WordPress &rsaquo; Error'=>'የወርድፕረስ &rsaquo; ስህተት','Site Icons are what you see in browser tabs, bookmark bars, and within the WordPress mobile apps. Upload one here!'=>'የጣቢያ አኮንኖች በአሳሽ ትርዎች ፣ በመጻህፍት መለያ አሞሌዎች እና በ ወርድፕረስ ሞባይል መተግበሪያዎች ውስጥ የሚያዩት ናቸው ። አንድ እዚህ ይጫኑ!','Your PHP installation appears to be missing the MySQL extension which is required by WordPress.'=>'የPHPህ ጭነት የሌለ ይመስላል   የMySQL ማራዘሚያ በወርድፕረስ የሚፈልገው ያጣ ይመስላል።','The WordPress address you entered did not appear to be a valid URL. Please enter a valid URL.'=>'ያቀረቡት የወርድፕረስ አድራሻ የሚሰራ URL ሆኖ አይታይም። የሚሰራ URL ያቅርቡ።   ','This resource is provided by your web host, and is specific to your site. For more information, <a href="%s" target="_blank">see the official WordPress documentation</a>.'=>'ይህ መገልገያ በድር አስተናጋጅዎ የቀረበ ነው፣ እና ለጣቢያዎ የተወሰነ ነው። ለበለጠ መረጃ <a href="%s" target="_blank">ይፋዊውን የወርድፕረስ ሰነድ ይመልከቱ</a>።','Copy and paste this URL into your WordPress site to embed'=>'ይህንን 